using System;
using System.Collections.Generic;
using System.Text;
using T7;

namespace T7
{
    class SymbolTranslator
    {
        public string TranslateSymbolToHelpText(string symbolname, out string helptext, out XDFCategories category, out XDFSubCategory subcategory, int ApplicationLanguage)
