                        description = helptext = "Reactietijd gasklep voor het verplaatsen van een stap overeenkomstige een koppel beperking. Gebruikt voor deceiding als een vermindering van de lucht moet worden gemaakt of als er gewoon een ontsteking vermindering dient te worden gemaakt. Als In.t_ExtTorqLimDuration is op minste tweemaal t_ThrReaction, dan lucht vermindering zal worden gemaakt. Resolutie is 1 ms. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_MaxIgnReduc":
                        description = helptext = "Maximale tijd voor ontsteking veroorzaakt door vermindering van het koppel beperken functie gedurende t_CoolDown tijd. Resolutie is 1 ms. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_ThrOverTime":
                        description = helptext = "Als In.t_ExtTorqLimDuration + t_ThrOverTime is verstreken sinds gestart en vermindering van lucht is niet actief, lucht verlaging wordt gemaakt totdat ExtTorqLim is voltooid. Resolutie is 1 ms. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_LDA2Lim":
                        description = helptext = "Minimale motorkoppel beperken, wanneer de bestuurder heeft het gaspedaal zo erg dat de voorwielen zijn uitglijden. Hoge limiet. Resolutie is 1 Nm. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_LDA1Lim":
                        description = helptext = "Minimale motorkoppel beperken, wanneer de bestuurder heeft het gaspedaal zo erg dat de voorwielen zijn uitglijden. Lage limiet. Resolutie is 1 Nm. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_DebFuelCut":
                        description = helptext = "Debouncing tijd gebruikt om te wachten op M_Engine overschrijding te verdwijnen voordat Fuel Cut Off is reqested wanneer berekend motorkoppel is hoger dan de maximum koppel + M_OffsFCutStart. Resolutie is 1 ms. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.n_Engine":
                        description = helptext = "Engine RPM EENHEID: rpm MAX: 7000 MIN: 0 TRANS: V = P *. Resolutie: 1. Interval is 10ms. ";
                        //category = XDFCategories.Out;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.n_EngineNomIdle":
                        description = helptext = "Nominale motor stationair RPM EENHEID: rpm MAX: 2000 min: 0 TRANS: V = P *. Resolutie: 1. Interval is 100ms. ";
                        //category = XDFCategories.Out;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleProt.C_A_Part":
                        description = helptext = "Werkelijke constante en adaptatie deel van stationair regelaar afhankelijk van de snelheid van het voertuig. Resolutie is 0,01 g / s. ";
                        //category = XDFCategories.IdleProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleProt.I_Part":
                        description = helptext = "Actueel ik deel stationair regelaar. Resolutie is 0,01 g / s. ";
                        //category = XDFCategories.IdleProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleProt.P_Part":
                        description = helptext = "Actueel P deel van stationair regelaar. Resolutie is 0,01 g / s. ";
                        //category = XDFCategories.IdleProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNComp.IgnRampTimer":
                        description = helptext = "Bevat de tijdspanne voor de oprit. Opgehaald uit een cal tabel. ";
                        //category = XDFCategories.DNComp;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.T_Engine":
                        description = helptext = "Temperatuur koelvloeistof motor EENHEID: (C Max: 150 MIN: -40 TRANS: V = P +4. Resolutie: 1. Interval is 1000ms. ";
                        //category = XDFCategories.Out;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.M_MaxAtActualRPM":
                        description = helptext = "Max motorkoppel op werkelijke RPM EENHEID: Nm MAX: 400 MIN: 0 TRANS: V = P / 2. Resolutie: 1. Interval is 20ms. ";
                        //category = XDFCategories.Out;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.M_Engine":
                        description = helptext = "motorkoppel EENHEID: Nm MAX: 400 MIN: -100 TRANS: V = (P +. Resolutie: 1. Interval is 10ms. ";
                        //category = XDFCategories.Out;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.X_AccPedal":
                        description = helptext = "Pedal functie eenheid:% MAX: 100 min: 0 TRANS: V = P * 1. Resolutie is 0.1. Interval is 20ms. ";
                        //category = XDFCategories.Out;
                        //subcategory = XDFSubCategory.Undocumented;
