                    case "MaxSpdCal.RampFac":
                        description = helptext = "factor voor de daling airmass gecompenseerd wanneer motortoerental zijn te hoog. Resolutie is 1 mg / c. ";
                        //category = XDFCategories.MaxSpdCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.AirOffset":
                        description = helptext = "factor voor de daling gevraagd airmass wanneer motortoerental te hoog. Resolutie is 1 mg / c. ";
                        //category = XDFCategories.MaxSpdCal;
                        //subcategory = XDFSubCategory.Undocumented;
