                        description = helptext = "Adaptie waarde voor idlespeed verordening (drive niet geactiveerd). Deze waarde wordt toegevoegd aan de PID en Constant deel van de toezichthouder. Als het I-deel beperkt is zal de adaptatie stoppen. Resolutie is 0,01 g / s. ";
