                        description = helptext = "Max motortoerental verschil tussen de werkelijke enginespeed en nominale stationair toerental te activeren idlemode. Resolutie is 1 tpm. ";
                        //category = XDFCategories.IdleCal;
                        //subcategory = XDFSubCategory.Undocumented;
