                        break;
                    case "MAFCal.FilterCFuelSteady":
                        description = helptext = "Airmass filter constant Brandstof berekening steady state. Formule: 100 * (new_value - old_value) + / - Const Filt_value = old_value + Const als old_value> new_value -> - Const, indien old_value <= new_value -> + Const Filt_value -> lokale Variabel gebruikt voor MAF.m_AirInletFuel old_value -> oud lokale Variabel new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCFuelSteady Als Const = 1 tot 8, effectieve filter wordt gebruikt (shift. plaats van afdelingen). (100 & 0 = 100% nieuw, 200 & 1 = 50% nieuwe, 400 & 2 = 25% nieuwe 800 & 3 = 12,5% nieuw, 1600 & 4 = 6,25% nieuwe enz.). Resolutie: 1. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.WeightCoefFConst":
                        description = helptext = "HFM - p_AirInlet gewicht coëfficiënt filter constant. Formule: 100 * (new_value - old_value) + / - Const Filt_value = old_value + Const als old_value> new_value -> - Const, indien old_value <= new_value -> + Const Filt_value -> MAFProt.HFMWeightCoef old_value -> oud MAFProt.HFMWeightCoef new_value -> lezen van kaart Const -> MAFCal.WeightCoefFConst Als Const = 1 tot 8, effectieve filter wordt gebruikt (shift. plaats van afdelingen). (100 & 0 = 100% nieuw, 200 & 1 = 50% nieuwe, 400 & 2 = 25% nieuwe 800 & 3 = 12,5% nieuw, 1600 & 4 = 6,25% nieuwe enz.). Resolutie: 1. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.X_RpmFiltConst":
                        description = helptext = "Filter constant motortoerental berekening voor het converteren tussen Q en m. Formule: 100 * (new_value - old_value) + / - Const Filt_value = old_value + Const als old_value> new_value -> - Const als old_value <= new_value -> + Const (100 = 100% nieuw, 200 = 50% nieuwe, 400 = 25% nieuw). Resolutie: 1. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.p_DeltaFuelTrans":
                        description = helptext = "Pressure delta limiet constant. Een absolute p_Delta waarde boven deze grens zal de negatieve of positieve brandstof transiënte vlag. De vlag wordt dan gedurende een gekalibreerde tijd. Dit maakt het mogelijk te berekenen MAF.m_AirInletFuel uit inlaatdruk zelfs indien p_Delta dicht bij 0, terwijl de HFM lezing heeft een grote afwijking ten opzichte van wat de druk bij de inlaat geeft. Resolutie is 1 kPa. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseAdap.SwitchOffCond":
                        description = helptext = "Informatie die verantwoordelijk was signaal uit te schakelen cruise control laatste tijd. Resolutie is 10 ms. ";
                        //category = XDFCategories.CruiseAdap;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Block.AD_ThrottleDemand":
                        description = helptext = "Shadow register van Out.AD_ThrottleDemand. Zullen worden gebruikt en gemanipuleerd terwijl stationair blok adaption actief is. Resolutie: 1. Interval is 10 ms. ";
                        //category = XDFCategories.Block;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseAdap.MissingCond":
                        description = helptext = "Informatie die signaal ontbreekt om over te schakelen op cruise control. Resolutie is 10 ms. ";
                        //category = XDFCategories.CruiseAdap;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterConstBoost":
                        description = helptext = "Airmass filter constant voor Boost functie. Formule: 100 * (new_value - old_value) + / - Const Filt_value = old_value + Const als old_value> new_value -> - Const, indien old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletBoost old_value -> oud MAF.m_AirInletBoost new_value -> MAF.m_AirInlet Const -> MAFCal.FilterConstBoost Als Const = 1 tot 8, effectieve filter wordt gebruikt (shift. plaats van afdelingen). (100 & 0 = 100% nieuw, 200 & 1 = 50% nieuwe, 400 & 2 = 25% nieuwe 800 & 3 = 12,5% nieuw, 1600 & 4 = 6,25% nieuwe enz.). Resolutie: 1. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterConstAir":
                        description = helptext = "Airmass filter constant airmass controle. Formule: 100 * (new_value - old_value) + / - Const Filt_value = old_value + Const als old_value> new_value -> - Const, indien old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletAir old_value -> oud MAF.m_AirInletAir new_value -> MAF.m_AirInlet Const -> MAFCal.FilterConstAir Als Const = 1 tot 8, effectieve filter wordt gebruikt (shift. istead van afdelingen). (100 & 0 = 100% nieuw, 200 & 1 = 50% nieuwe, 400 & 2 = 25% nieuwe (800 & 3 = 12,5% nieuw, 1600 & 4 = 6,25% nieuwe enz.). Resolutie: 1. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.t_FreezeNegTrans":
                        description = helptext = "Tijd om negatieve transiënte vlaggen ingesteld terwijl de HFM-signaal maakt grote onder schot. Als deze constante 0 is, dan geen negatieve transiënten zal trigged. Resolutie is 1 ms. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.p_DeltaTransLim":
                        description = helptext = "Pressure delta limiet constant. Een absolute p_Delta waarde boven deze grens zal de negatieve of positieve transiënte vlag voor de berekening van de belasting van de motor voor ontsteking en koppel functies. De vlag wordt dan gehouden voor een gekalibreerd tijd. Het wordt gebruikt voor het kopiëren m_AirInletFrompInlet te MAF.m_AirInletIgn tijdens negatieve transiënten en voor het kopiëren m_AirInletFrompInlet te MAF.m_AirInletTorq tijdens positve transiënten. Steady-state beide worden gefilterd HFM-signalen. Bij het schakelen tussen m_AirInletFrompInlet en HFM-signaal, een simpel adaption wordt gebruikt om soepele overgangen. Resolutie is 1 kPa. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.t_FreezePosTrans":
                        description = helptext = "Tijd om positieve transiënte vlaggen ingesteld terwijl de HFM-signaal maakt dan grote kans. Als deze constante 0 is, is geen positieve transiënten zal trigged. Resolutie is 1 ms. ";
                        //category = XDFCategories.MAFCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.Q_AirFromp_AirInlet":
                        description = helptext = "Redundante berekend airmassflow. Omgezet van m_AirFromp_AirInlet. Resolutie is 0,01 g / s. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.HFMWeightCoef":
                        description = helptext = "Actual filter constant Brandstof airmass filter. Resolutie: 1. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.t_PosTransFreez":
                        description = helptext = "Tijd om positieve transiënte vlag vastgesteld na MAFProt.p_DeltaInlet in steady-state niveau opnieuw. Resolutie is 1 ms. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.p_DeltaInlet":
                        description = helptext = "Actueel drukverschil in het inlaatspruitstuk worden gebruikt voor airmass filteren. Resolutie is 1 kPa. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.LoadPointer":
                        description = helptext = "Laad aanwijzer in redundante airmassflow Kaart. LoadPointer = In.p_AirInlet * ConstT_Engine * ConstT_AirInlet. Resolutie: 1. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "O2SensPostCal.LambdaMax":
                        description = helptext = "De maximaal toegestane Lambda.LambdaInt te lopen O2SensPost Laag Diagnose. Resolutie is 0,01. ";
                        //category = XDFCategories.O2SensPostCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.X_DecreaseStep":
                        description = helptext = "Aantal lezingen in een rij waar t_tdc_tdc is afgenomen. Gebruikt voor het definiëren van transiënten. Resolutie: 1. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.t_NegTransFreez":
                        description = helptext = "Tijd om negatieve transiënte vlag vastgesteld na MAFProt.p_DeltaInlet in steady-state niveau opnieuw. Resolutie is 1 ms. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.X_IncreaseStep":
                        description = helptext = "Aantal lezingen in een rij waar t_tdc_tdc is toegenomen. Gebruikt voor het definiëren van transiënten. Resolutie: 1. ";
                        //category = XDFCategories.MAFProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletAir":
                        description = helptext = "Airmass in milligram per verbranding. Gefilterd, gebruikt voor Air controle functies. Resolutie is 1 mg / c. Interval is 10ms. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletIgn":
                        description = helptext = "Airmass in milligram per verbranding. Gefilterd, gebruikt voor de ontsteking berekening. Resolutie is 1 mg / c. Interval elke verbranding. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletTorq":
                        description = helptext = "gefiltreerd airmass variabele kopiëren MAF. M_AirFromp_AirInlet in positieve transiënten, MAF.m_AirInletAir tijdens negatieve transiënten en steady state. Resolutie is 1 mg / c. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirFromp_AirInlet":
                        description = helptext = "Redundante berekend airmassflow. Lees uit p_AirInlet sensor gecompenseerd voor de temperatuur van de inlaatlucht en koelwater temperatuur. Resolutie is 1 mg / c. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.Q_AirInletFilt":
                        description = helptext = "Inlet verzamelleiding luchtstroom uit MAF sensor in gram per seconde gefiltreerd. Deze luchtstroom wordt herberekend vanaf MAF.m_AirInletAir. Resolutie is 0,01 g / s. Interval elke verbranding. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInlet":
                        description = helptext = "Airmass in milligram per verbranding. Dit airmass is de werkelijke belasting in de ECM. (Ongefilterd) Berekend uit ActualIn.Q_AirInlet. Resolutie is 1 mg / c. Interval elke verbranding. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletFuel":
                        description = helptext = "Airmass in milligram per verbranding. Gefilterd, worden gebruikt voor brandstof berekening. Resolutie is 1 mg / c. Interval elke verbranding. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletBoost":
                        description = helptext = "Airmass in milligram per verbranding. Gefilterd, worden gebruikt voor aanjaagdrukregeling. Resolutie is 1 mg / c. Interval elke verbranding. ";
                        //category = XDFCategories.MAF;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Block.AD_ThrottleSum":
                        description = helptext = "Variabele voegt eraan toe dat de AD-waarde voor de stationaire gasklep blok in een bepaalde tijd, voor de berekening van de adaptieve VIOSAdap.AD_ThrottleBlock. Resolutie: 1. Interval is macht en macht OP UIT. ";
                        //category = XDFCategories.Block;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalProt.AD_EstimatePos":
                        description = helptext = "geschatte positie voor een mogelijke nieuwe pedaal blok van pedaal poti 1. Resolutie is beetje. ";
                        //category = XDFCategories.PedalProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalProt.AD_CapturedPos":
                        description = helptext = "Opgenomen pedaal positie van het pedaal poti 1. Resolutie is beetje. ";
                        //category = XDFCategories.PedalProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_AngleMax":
                        description = helptext = "Maximaal gasklep hoek. Resolutie is beetje. ";
                        //category = XDFCategories.AngleLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PwmLimitCal.ms_Time":
                        description = helptext = "Debouncing tijd voor de uitvoering van PWM beperking als gevolg van 100% PWM bij het openen of sluiten van richting. Wanneer PWM beperking is besteld zal het niet worden uitgevoerd zolang deze tijd is verstreken. Zij vertegenwoordigen hoe lang het duurt voordat de temperatuur in de gasklep huis overtreft max. specificaties. Resolutie is 1 ms. ";
                        //category = XDFCategories.PwmLimitCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_StartLow":
                        description = helptext = "startangle voor hoek beperking lager bereik. Resolutie is beetje. ";
                        //category = XDFCategories.AngleLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_GradLow":
                        description = helptext = "Gradient voor gasklep hoek beperking ondergrens. Resolutie is beetje. ";
                        //category = XDFCategories.AngleLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_StartHigh":
                        description = helptext = "startangle voor hoek beperking bovenste bereik. Resolutie is beetje. ";
                        //category = XDFCategories.AngleLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PwmLimit.ms_Timer":
                        description = helptext = "Timer aan debounce de PWM beperking indien besteld als gevolg van 100% PWM bij het openen of sluiten van richting. Resolutie is 1 ms. Interval is 10 ms. ";
                        //category = XDFCategories.PwmLimit;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PwmLimitCal.Size":
                        description = helptext = "Grootte van de tabel pwmlimit = f (u_Batt). Resolutie is 1 bit. ";
                        //category = XDFCategories.PwmLimitCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_AngleMin":
                        description = helptext = "Minimale gasklep hoek. Resolutie is beetje. ";
                        //category = XDFCategories.AngleLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalProt.AD_FilteredPos":
                        description = helptext = "Gefilterde pedaal positie van het pedaal poti 1. Resolutie is beetje. ";
                        //category = XDFCategories.PedalProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOSCal.v_TCSOffset":
                        description = helptext = "Boven deze snelheid van het voertuig, voegen niet gecompenseerd op televisiecamerasystemen verzoek. Dit is omdat boven een bepaalde snelheid, de remmen worden niet geactiveerd voor het regelen van de slip. ";
                        //category = XDFCategories.VIOSCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOSCal.M_TCSOffset":
                        description = helptext = "Offset toegevoegd ActualIn.M_TCSReq zolang de snelheid van het voertuig (achter snelheid sensor) lager is dan een calibratable snelheid AMD de eerste versnelling op handmatige auto's is niet in staat ";
                        //category = XDFCategories.VIOSCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOSCal.M_TCMOffset":
                        description = helptext = "Offset toegevoegd ActualIn.M_TCMLimitReq op de eerste versnelling, zolang In.t_TCMTrqLimDuration == 0. Dit is een oplossing voor de TCM als ze geen mogelijkheid om hun software. ";
                        //category = XDFCategories.VIOSCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Block.Min":
                        description = helptext = "Variabele die slaat de minimale waarde van een adaptatie. Resolutie is 1 bit. Interval is een keer als adaptatie is actief. ";
                        //category = XDFCategories.Block;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Block.New":
                        description = helptext = "Variabele die slaat de nieuwe blok waarde. Resolutie is 1 bit. Interval is een keer als adaptatie is actief. ";
                        //category = XDFCategories.Block;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Block.Max":
                        description = helptext = "Variabele die slaat de maximale waarde van een adaptatie. Resolutie is 1 bit. Interval is een keer als adaptatie is actief. ";
                        //category = XDFCategories.Block;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Block.AD_TmpThrBlock":
                        description = helptext = "Variabele gebruikt voor de tijdelijke opslag van gas blok adaption waarde. Resolutie is 1 bit. Interval is macht en macht OP UIT. ";
                        //category = XDFCategories.Block;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AreaAdap.A_Throttle":
                        description = helptext = "Aanpassing van gasklep gebied. Interval is 250ms. ";
                        //category = XDFCategories.AreaAdap;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalProt.AD_PedalPot1":
                        description = helptext = "Gekopieerd pedal1 standpunt omdat pedal1 gelezen is om de 5 ms. Resolutie is beetje. ";
                        //category = XDFCategories.PedalProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BlockPoti2.Min":
                        description = helptext = "Variabele die slaat de minimale waarde van een aanpassing van poti2. Resolutie is 1 bit. Interval is een keer als adaptatie is actief. ";
                        //category = XDFCategories.BlockPoti2;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BlockPoti2.New":
                        description = helptext = "Variabele die slaat de nieuwe blok waarde uit poti2. Resolutie is 1 bit. Interval is een keer als adaptatie is actief. ";
                        //category = XDFCategories.BlockPoti2;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BlockPoti2.Max":
                        description = helptext = "Variabele die slaat de maximale waarde van een aanpassing van poti2. Resolutie is 1 bit. Interval is een keer als adaptatie is actief. ";
                        //category = XDFCategories.BlockPoti2;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOSCal.ST_TAirInlet":
                        description = helptext = "Welke temperatuur sensor te gebruiken. 0 = Oude sensor 1 = Nieuwe sensor ";
                        //category = XDFCategories.VIOSCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimProt.Q_MinLoad":
                        description = helptext = "De laagste airmass de motor moet op de werkelijke motortoerental. Resolutie is 0,01 g / s. ";
                        //category = XDFCategories.AirMinLimProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.ControllerOut":
                        description = helptext = "Airmass output van de airmass controller. Toevoeging van de PID gedeeltelijk gesloten lus. Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.MaxAirmass":
                        description = helptext = "Maximaal airmass afhankelijk van het motortoerental. Berekend uit de standaard airmass kaart. Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.DeltaN0":
                        description = helptext = "Airmass afwijkingen voor de lus (werkelijke - 1). Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.iPartN0":
                        description = helptext = "I-deel van de airmass-controller voor de lus (werkelijke - 1). Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.DeltaN1":
                        description = helptext = "Ongefilterde airmass afwijking voor de werkelijke lus. Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.m_CtrlOutput":
                        description = helptext = "Airmass uitgang van de I-controller. Resolutie is 1 mg / c. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.Request":
                        description = helptext = "Aangezochte airmass. Gekopieerd van de variabele Air.m_Request.AirMass. Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.Actual":
                        description = helptext = "Actueel airmass. Gekopieerd van de variabele MAF.m_AirInlet. Resolutie is 1 mg / c. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLim.m_LDAReq":
                        description = helptext = "Van Torque Master verzocht min airmass voor LDA functie. Resolutie is 1 mg / c. ";
                        //category = XDFCategories.AirMinLim;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngACShtLow":
                        description = helptext = "Motortoerental beperken. Als het toerental van de motor lager is dan deze limiet, wanneer de bestuurder duwt de Acc.Pedal boven een gekalibreerd beperking, de AC uitgeschakeld functie actief zal zijn. Resolutie is 1 tpm. ";
                        //category = XDFCategories.LoadCoCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngACShtHigh":
                        description = helptext = "Motortoerental beperken. Boven dit toerental van de motor het AC zal worden ingeschakeld, indien de uitschakeling functie actief is geweest. Resolutie is 1 tpm. ";
                        //category = XDFCategories.LoadCoCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.X_AccPACShtOff":
                        description = helptext = "Gaspedaal limiet. Als het toerental van de motor lager is dan een gekalibreerd beperken wanneer de bestuurder duwt de Acc.Pedal boven deze limiet, de AC uitgeschakeld functie actief zal zijn. De functie zal worden gestopt wanneer de driver is het vrijgeven van de pedaal beneden deze grens, minus 10% of als het toerental van de motor wordt hoger dan de limiet LoadCoCal.n_EngACShtHigh of indien de max. tijd is verstreken. Resolutie is 0,1%. ";
                        //category = XDFCategories.LoadCoCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
