                    case "CruiseFilterCal.t_592Deb":
                        description = helptext = "Tijd voor debounce de cc_allowed info uit de 592. Resolutie is 1 bit. ";
                        //category = XDFCategories.CruiseFilterCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErr2Prot.ST_LimpHome":
                        description = helptext = "Bit 7 in deze byte geeft aan wanneer het gaspedaal wordt in limphome modus. ";
                        //category = XDFCategories.ThrErr2Prot;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.TimerLimit":
                        description = helptext = "Timerlimit dalen M_DeltaRoad voor roadload berekening als rem signaal is actief in te stellen M_RoadLoad1 de standaardstijl roadload. Resolutie is 0.1 sec. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrCal.ThrPotSumDiff":
                        description = helptext = "Als (ActualIn.AD_ThrottlePot1 + ActualIn.AD_ThrottlePot2)> (1164 - ThrErrCal.ThrPotSumDiff) de vlag ThrErr.ST_WiperCleaner, die triggs de Ruitewisser-Cleaner functie, wordt vastgesteld. Als 592 aangeven gasklep sensoren som fout in dit geval debouncing lange tijd worden gebruikt. Zie de beschrijving voor ThrErrCal.t_ThrSumInfo en ThrErrCal.t_ThrSumLimp. Resolutie: 1. ";
                        //category = XDFCategories.ThrErrCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_RoadSize":
                        description = helptext = "Nummer van de steun voor de standaard roadload kaart ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Ser339Prot.SerialStatus":
                        description = helptext = "Status byte voor seriële communicatie tot 592. 0 = Probleem met zowel RX en TX. Tx huidige status is eigenlijk onbekend, maar er was een probleem voor rx mislukt. 1 = Probleem met tx. 2 = Probleem met rx, tx status onbekend. 3 = OK. ";
                        //category = XDFCategories.Ser339Prot;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_MinSize":
                        description = helptext = "Aantal steunpunten voor offset te motorkoppel te beperken integrator ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrProt.RomErrCounter":
                        description = helptext = "ROM-fout in 592 moeten zijn ontdekt 4 keer voor fout in 339 is ingesteld. Deze teller wordt gebruikt. ";
                        //category = XDFCategories.ThrErrProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrProt.ST_LimSpr":
                        description = helptext = "Detectie van vrijgegeven limphome voorjaar. OP = Spring relesead. UIT = voorjaar niet vrijgegeven. ";
                        //category = XDFCategories.ThrErrProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrProt.PedAdapStored":
                        description = helptext = "Geef aan dat het pedaal adaption fout is geldig. De 592 hebt opgeslagen een geldig adaptatie in de 339. ";
                        //category = XDFCategories.ThrErrProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrProt.ST_DKShortCut":
                        description = helptext = "Detectie van korte teruggebracht tot +12 V in de H-brug. OP = Snelkoppeling OFF = geen snelkoppeling. ";
                        //category = XDFCategories.ThrErrProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrProt.ST_ThrStartup":
                        description = helptext = "Bit 7 in deze byte geeft aan wanneer het gaspedaal wordt in limphome modus. ";
                        //category = XDFCategories.ThrErrProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErrProt.ST_LimpHome":
                        description = helptext = "Bit 7 in deze byte geeft aan wanneer het gaspedaal wordt in limphome modus. ";
                        //category = XDFCategories.ThrErrProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseCal.a_AccSize":
                        description = helptext = "Aantal steunpunten om gevraagd accelaration of vertraging. Resolutie is beetje. ";
                        //category = XDFCategories.CruiseCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PowInhAdap.ErrCounter":
                        description = helptext = "Aantal macht stadium remmen test schuld, zonder enige correcte test. ";
                        //category = XDFCategories.PowInhAdap;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseCal.M_GradSize":
                        description = helptext = "Aantal steunpunten te krijgen koppel gradiënt beperking. Resolutie is beetje. ";
                        //category = XDFCategories.CruiseCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseCal.a_DecTimeLim":
                        description = helptext = "Debouncing tijd voor vertraging drempel uit te schakelen cruise control. Resolutie is 20 ms. ";
                        //category = XDFCategories.CruiseCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ROM339ChksmCal.ST_Enable":
                        description = helptext = "Vlag staat voor de ROM 339 checksum test 1 = Checksum test ingeschakeld 0 = Checksum test uitgeschakeld ";
                        //category = XDFCategories.ROM339ChksmCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseCal.v_LimitSize":
                        description = helptext = "Bedrag van de steunpunten voor v limiet voor het verminderen van de a_Request0 v_limit = f (verzocht de snelheid van het voertuig). Resolutie is beetje. ";
                        //category = XDFCategories.CruiseCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ADCCal.FilterConst":
                        description = helptext = "Filter constante voor de berekening van het pedaal signaal 1 & 2. PEDAL = PEDAL (n-1) * FilterConst + In.AD_AccPedal FilterConst + 1 ";
                        //category = XDFCategories.ADCCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.ComFac_5":
                        description = helptext = "Comfort factor voor staat 5 procentpunten van a_Request1 als je bent in staat 5. Resolutie%. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ADC2Cal.FilterConst":
                        description = helptext = "Filter constante voor de berekening van het pedaal signaal 1 & 2. PEDAL = PEDAL (n-1) * FilterConst + In.AD_AccPedal FilterConst + 1 ";
                        //category = XDFCategories.ADC2Cal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErr2Cal.ThrPotSumDiff":
                        description = helptext = "Als (In.AD_ThrottlePot1 + In.AD_ThrottlePot2)> (1164 - ThrErr2Cal.ThrPotSumDiff) de vlag ThrErr2.ST_WiperCleaner, die triggs de Ruitewisser-Cleaner functie, wordt vastgesteld. Als 592 aangeven gasklep sensoren som fout in dit geval debouncing lange tijd worden gebruikt. Zie de beschrijving voor ThrErr2Cal.t_ThrSumInfo en ThrErr2Cal.t_ThrSumLimp. Resolutie: 1. ";
                        //category = XDFCategories.ThrErr2Cal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.ComFac_7":
                        description = helptext = "Comfort factor voor staat 7 procent van a_Request1 als u bent in staat 7. Resolutie%. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.ComFac_6":
                        description = helptext = "Comfort factor voor staat 6 procent van a_Request1 als je bent in staat 6. Resolutie%. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.v_FCOEnable":
                        description = helptext = "Boven deze snelheid van het voertuig FCO afwijking is toegestaan. Resolutie is 0,1 km / h. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_DefOffset":
                        description = helptext = "Negatieve gecompenseerd voor roadload geschaald in% van de standaard roadload zal worden gebruikt voor het initialiseren van de cruise wiel integrator. Resolutie is 1%. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.ComFac_4":
                        description = helptext = "Comfort factor voor staat 4 procentpunten van a_Request1 als u in staat 4. Resolutie%. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PowInhCal.Number":
                        description = helptext = "Aantal mislukte test voordat limphome. ";
                        //category = XDFCategories.PowInhCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.MaxInit":
                        description = helptext = "Maximaal init PULS in positieve richting geschaald in motorkoppel. Resolutie is Nm. ";
                        //category = XDFCategories.CruiseComCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErr2.ST_WiperCleaner":
                        description = helptext = "Vlag te wijzen op een positieve gasklep sensor som fout. Deze vlag wordt gebruikt om trigg de WiperCleaner functie. Als 592 aangeven gasklep sensoren som fout in dit geval debouncing lange tijd worden gebruikt. Zien beschrijving voor ThrErr2Cal.t_ThrSumInfo en ThrErr2Cal.t_ThrSumLimp. ";
                        //category = XDFCategories.ThrErr2;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.FilterRamp":
                        description = helptext = "Ramp van het filter voor constante versnelling als de veranderingen in het systeem van niet arrestantenlokaal tot sluitingsuur. Resolutie is 1 Bit / 50ms. ";
                        //category = XDFCategories.CCRatioCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErr.ST_FuelCutOrdered":
                        description = helptext = "Brandstof gesneden volgorde van ThrLimp om het systeem veilig is. ";
                        //category = XDFCategories.ThrErr;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErr.ST_CCNotAllowed":
                        description = helptext = "Vermeld bij Cruise controller die fout # 27 is actief (CC uitgeschakeld fout) ";
                        //category = XDFCategories.ThrErr;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ThrErr.ST_WiperCleaner":
                        description = helptext = "Vlag te wijzen op een positieve gasklep sensor som fout. Deze vlag wordt gebruikt om trigg de WiperCleaner functie. Als 592 aangeven gasklep sensoren som fout in dit geval debouncing lange tijd worden gebruikt. Zien beschrijving voor ThrErrCal.t_ThrSumInfo en ThrErrCal.t_ThrSumLimp. ";
                        //category = XDFCategories.ThrErr;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.Hysteresis":
                        description = helptext = "Hysterese voor versnelling vóór de feitelijke verhouding is ingesteld op de nieuwe one.This ratio wordt alleen gebruikt voor het converteren M_Wheel te M_Engine. Resolutie: 1 Bit. ";
                        //category = XDFCategories.CCRatioCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_IgnInflTorq":
                        description = helptext = "Ontstekingssysteem invloed op koppel lezen van matrix. Resolutie is 0,1 Nm / graden. ";
                        //category = XDFCategories.TorqueProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.ST_NoiseReduc":
                        description = helptext = "Status blijkt welke modus is werkelijk voor de ruisonderdrukking functie. 0 = Geen reductie. 1 = Vermindering is trigged maar niet geactiveerd. 2 = Vermindering is aangevraagd bij gekalibreerd niveau. 3 = vermindering is aangevraagd en speedramp. ";
                        //category = XDFCategories.Torque;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.manualgear":
                        description = helptext = "Opgeslagen vistuig sinds de laatste oproep van Torquemaster ";
                        //category = XDFCategories.TorqueProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.OverBoostMode":
                        description = helptext = "Welke modus de overboostfunction is 0 = geen overboost 1 = Overboost 2 = Ramping 3 = Overboost niet toegestaan 4 = Niet overboosting 5 = Koeling ";
                        //category = XDFCategories.TorqueProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_NewActGear":
                        description = helptext = "Actueel vistuig. Gebruikt voor de detectie van schakelindicatoren. Nieuw nummer te maken detectie van verschuiving omhoog en omlaag verschuiven makkelijker. 2 - Omgekeerde 3 - Neutraal 5 - Gear 1 6 - Gear 2 7 - Gear 3 8 - Gear 3, lock-up 9 - Gear 4 10 - Gear 4, lock-up ";
                        //category = XDFCategories.TorqueProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_OldActGear":
                        description = helptext = "Actueel vistuig 10 ms geleden. Gebruikt voor de detectie van schakelindicatoren. Nieuw nummer te maken detectie van verschuiving omhoog en omlaag verschuiven makkelijker. 2 - Omgekeerde 3 - Neutraal 5 - Gear 1 6 - Gear 2 7 - Gear 3 8 - Gear 3, lock-up 9 - Gear 4 10 - Gear 4, lock-up ";
                        //category = XDFCategories.TorqueProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimCal.ClutchMode":
                        description = helptext = "Functiekeuzeschakelaar over het instellen van de gearshifting vlag, EmLim.ST_GearShifting. Standen: 0 - Gebruik alleen de In.ST_ClutchBrake1 1 - Gebruik zowel de In.ST_ClutchBrake1 en als de koppeling wordt ingedrukt voor meer dan EmLimCal.t_ClutchDelay ms, start de overbrengingsverhouding versnellingshendel detectie. 2 - Gebruik alleen de overbrengingsverhouding versnellingshendel detectie. Overbrengingsverhouding versnellingshendel detectie: Als het pedaal wordt vrijgegeven onder de 10% is een hoge en lage verhouding berekende maximum, EmLimProt.RatioLow en EmLimProt.RatioHigh, wanneer de ratio hoger is dan de hoge limiet of onder de lage limiet is de EmLim.ST_GearShifting vlag ingesteld. Wanneer het pedaal is boven de 5% en een hogere versnelling wordt gedetecteerd en de EmLimProt.RatioDelta minder dan 5 zal de EmLim.ST_GearShifting vlag worden gewist. ";
                        //category = XDFCategories.EmLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLim.ST_GearShifting":
                        description = helptext = "Deze vlag is ingesteld wanneer de koppeling wordt ingedrukt. Ofwel, door het opsporen van de In.ST_ClutchBrake1 of door detectie van een verandering in versnelling na het pedaal is vrijgegeven onder de 10%. Wanneer deze vlag is ingesteld zal de lucht antijerk worden uitgeschakeld. ";
                        //category = XDFCategories.EmLim;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.ST_FuelCutReq":
                        description = helptext = "Status variabele blijkt als koppel Master verzoeken Fuel Cut Off. De FCO verzoek zal komen indien M_Engine> koppel limiet + gekalibreerd gecompenseerd. 0 = Fuel Cut Off niet om 1 = Fuel Cut Off gevraagd ";
                        //category = XDFCategories.Torque;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.ST_ExtTrqLim":
                        description = helptext = "Ontstekingssysteem invloed op koppel lezen van matrix. 0 = Extern Limit Req zal worden gemaakt door de lucht vermindering 1 = korte tijd, vermindering zal alleen worden gedaan door ontsteking 2 = langere tijd, verlaging door de lucht gewoon voor een tijdje 3 = Overuren, Request heeft durated meer dan In.t_ExtLimDuration + TorqueCal.t_ThrOverTime ";
                        //category = XDFCategories.Torque;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.ST_Enable":
                        description = helptext = "Mogelijkheid tot uitschakelen van de motorcarters geval ventilatie ventiel controle. 0 = Crank zaak Ventilatie Ventiel functie OFF Diagnose uitgeschakeld. 1 = Crank zaak Ventilatie Ventiel functie OP Diagnose ingeschakeld. ";
                        //category = XDFCategories.CrnkCVCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.p_DiffLimit":
                        description = helptext = "Pressure beperken. Zolang In.p_Air <In.p_AirInlet + CrnkCVCal.p_DiffLimit + CrnkCVCal.p_DiffLimitHys de motorcarters geval ventilatie klep wordt geopend. Resolutie is 0,1 kPa. ";
                        //category = XDFCategories.CrnkCVCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.p_DiffLimitHys":
                        description = helptext = "Hysterese om ventiel te klep / klep. Wanneer de slinger geval klep geopend is: CrnkCVProt.p_DiffLimit = CrnkCVCal.p_DiffLimit + CrnkCVCal.p_DiffLimitHys. Resolutie is 0,1 kPa. ";
                        //category = XDFCategories.CrnkCVCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt.ST_PedalIdle":
                        description = helptext = "Geeft aan dat pedaal is in idle stand. De pedal2 stationair informatie wordt gelezen door de 592, naar de 339 en debounced. Resolutie is \"0\" => niet in idle. ";
                        //category = XDFCategories.SwitchProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngCal.Status":
                        description = helptext = "Status uitgeschakeld beperken motor controle. ";
                        //category = XDFCategories.LimEngCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt1.ST_PedalIdleOld":
                        description = helptext = "Geeft aan dat pedaal is in idle standpunt ten aanzien van pedaal poti 1. Resolutie is \"0\" => niet in idle. ";
                        //category = XDFCategories.SwitchProt1;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt.PedalDebounce":
                        description = helptext = "Debouncing timer voor pedal2 stationair informatie tijdens het verplaatsen van niet-stationair tot stationair. Deze timer is ook indirect gebruikt worden door de beperking die functie wordt actief als het pedal2 inactief is en het gebied verzoek is boven de switchpoint. De debouncing tijd moeten worden zolang de oppervlakte verzoek treedt \"Onbelaste stand\" na het loslaten van het pedaal. Resolutie is 10 ms. ";
                        //category = XDFCategories.SwitchProt;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimCal.ST_Loop":
                        description = helptext = "Engine Airmassflow Min Limit reguleren lus controle variabele. \"0\" - Beperk zal niet worden beschouwd. \"1\" - Open-lus. \"2\" - Sluit lus. ";
                        //category = XDFCategories.AirMinLimCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_OffsFCOStart":
                        description = helptext = "Verschil tussen de werkelijke motorkoppel en koppel limiet berekend door de Torque-Master, waar Fuel Cut Off zal beginnen te worden aangevraagd. Resolutie is 1 Nm. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_OffsFCOStop":
                        description = helptext = "Verschil tussen de werkelijke motorkoppel en koppel limiet berekend door de Torque-Master, waar Fuel Cut Off zal niet worden gevraagd. Resolutie is 1 Nm. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_HysIgnRedOff":
                        description = helptext = "Verschil tussen de werkelijke motorkoppel en koppel limiet berekend door de Torque-Master, waar Ontstekingssysteem verlaging stopt te worden gebruikt. Het wordt ook gebruikt als IGN. rood. hysterese starten wanneer de TCM heeft een korte koppel verlaging, omdat de M_HysIgnRedOn is groter dan deze gegevens. Resolutie is 1 Nm. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.ST_Loop":
                        description = helptext = "Limit Wheel airmass controle lus status variabele. \"0\" - Beperk zal niet worden beschouwd. \"1\" - Open-lus. \"2\" - Sluit lus. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.X_CoolFactor":
                        description = helptext = "factor voor de vermindering van koeling tijdstip van aftrek van geaccumuleerde ontsteking verlaging tijd, veroorzaakt door koppel beperken functie. 0 -> afgetrokken tijd = tijd / 1 1 -> afgetrokken tijd = tijd / 2 2 -> afgetrokken tijd = tijd / 4 3 -> afgetrokken tijd = tijd / 8 4 -> afgetrokken tijd = tijd / 16 ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEng.ST_MaxLimActive":
                        description = helptext = "Status variabele aangeeft welke MaxLim is actief (laagste) voor dit moment. 0 = Knock limiet 1 = Max motor snelheidsbeperking 2 = Performance controle 3 = Max turbo snelheidsbeperking 4 = Crank geval ventilatie defecte 5 = Defecte APC ";
                        //category = XDFCategories.LimEng;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirctlData.FreezeIPart":
                        description = helptext = "Status vlag te bevriezen I-deel. Resolutie is 1 bit. Interval is 10 ms. ";
                        //category = XDFCategories.AirctlData;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_HysIgnRedOn":
                        description = helptext = "Verschil tussen de werkelijke motorkoppel en koppel limiet berekend door de Torque-Master, waar Ontstekingssysteem vermindering zal beginnen te worden gebruikt. Resolutie is 1 Nm. ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.ST_XAccLimRes":
                        description = helptext = "Te hoge motorkoppel op schakelindicatoren tijdens RESUME Activeert de \"Beperking functionaliteit 'in de Gear Shift Support functie dat: - de vriezer Out.X_AccPedal een bepaalde tijd na schakelindicatoren en - vertragen veranderingen in Out.X_AccPedal, max. Out.X_AccPedal delta ook tijdens een RESUME (Cruise.ST_ResumeMode == 1). De functie wordt gebruikt voor het voorkomen van onnodige schakelindicatoren maar kan leiden tot \"harde\" schakelindicatoren. Alleen gebruikt in de automatische auto's bij het rijden met cruise control en niet dwingende cruise met gaspedaal. 0 = Beperking functie niet actief tijdens RESUME 1 = bevriezing van Out.X_AccPedal na schakelindicatoren tijdens RESUME 2 = Limiet verandering van Out.X_AccPedal tijdens RESUME 3 = 1 + 2 ";
                        //category = XDFCategories.TorqueCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalMapCal.ST_Function":
                        description = helptext = "initialisering van de functie-status; hier speciaal om de status voor het pedaal; ";
                        //category = XDFCategories.PedalMapCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalMapCal.ST_NoiseRed":
                        description = helptext = "Deze vlag controles als de kickdown vlag wordt aangegeven wanneer de kickdown koppel ruisonderdrukking is actief. Als deze vlag is ingesteld en Torque.ST_NoisReduc niet gelijk is aan nul zal kickdown niet te worden vermeld. ";
                        //category = XDFCategories.PedalMapCal;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.StartAirMode":
                        description = helptext = "Vermeld de werkelijke start-modus. 1 - Rpm lager dan de nominale stationair toerental + n_EngNomExtra - n_EngLOffOffset. De IdleProt.Q_StartOffs wordt gebruikt boven stationair adaptatie en constant deel. De conversie van airmass aan gaspedaal gebied is Gedaan met vaste enginespeed (Nominaal toerental van de motor). 2 - De IdleProt.Q_StartOffs is ramped aan nul. De voorwaarde om in mode 0 is: IdleProt.Q_StartOffs = 0 of (Motortoerental druppels onder nominale stationair toerental + IdleCal.n_EngNomExtra EN IdleProt.Q_StartOffs <= IdleCal.I_PartMax en meer dan 10 zelfontbrandingen in mode 2) Als de bovenstaande voorwaarde is waar zal de rest van IdleProt.Q_StartOffs worden copyed aan de IdleProt.I_Part en stationair controle zal worden vrijgegeven. 0 - Engine functioneren en de Q_StartOffs niet meer wordt gebruikt. Idle is vrijgegeven. ";
                        //category = XDFCategories.Idle;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.ST_IdleRpmInAreaMap":
                        description = helptext = "Geef aan dat de omzetting van m_Request aan Ruimte verzoek moet gebruik maken van de nominale stationair toerental als aanwijzer in het gebied kaart. Dit gebeurt terwijl de \"Idle.StartAirMode\" = 1. 1 => Gebruik stationair toerental 0 => Gebruik werkelijke motor snelheid ";
                        //category = XDFCategories.Idle;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.I_PartLimited":
                        description = helptext = "Geef aan dat het I-deel is gestopt omdat het zijn grens heeft bereikt. 0 -> I-deel niet beperkt 1 -> I-deel op zijn max limiet -1 -> I-deel op haar min limiet ";
                        //category = XDFCategories.Idle;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.ST_Enable":
                        description = helptext = "Vermeld als idlespeed verordening is actief. \"ON\" - Idlespeed regelgeving actief: de motor is gestart, Vehiclespeed <3 km / h, In.X_AccPedal <IdleCal.X_AccPedalLim, motortoerental verschil niet groter is dan IdleCal.n_EngDiffLim, motortoerental delta niet hoger dan IdleCal.n_EngDeltaLim en gas niet in limphome. \"-\" - Idlespeed verordening niet actief is, wordt alleen de constante deel en adaptatie deel worden gebruikt. ";
                        //category = XDFCategories.Idle;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.ST_AdapAllowed":
                        description = helptext = "Vermeld of stationair adaptatie is toegestaan. 1 - Idlespeed adaptatie toegestaan 0 - Idlespeed adaptatie niet toegestaan volgende voorwaarden moet worden voldaan om stationair adaptatie: - Motor temp boven de limiet - Niet te hoog verschil in rpm - stationair I-deel niet beperkt: Stationair lucht nog steeds groter dan minload lucht, Throttle gebied> 10 mm2 I-deel groter dan -5,00 g / s I-deel minder dan +5.00 g / n - Geen fout op automatische Gear -Box drive signaal (FaultIn.M_ExternLimitReq & 0xF0) = 0 - Geen lightoff offset, IdleProt.n_EngLOffOffset = 0 - Geen servopressure comp, LoadCo.ST_IdleAdapt = 0 - Geen schuld op vehiclespeed, FaultIn.v_Vehicle = 0 - Lightoff rpm gecompenseerd niet actief, IdleProt.n_EngLOffOffset = 0 ";
                        //category = XDFCategories.Idle;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
