                        description = helptext = "Interne staat in de staat de controle van de machine Drive Neutrale lucht en ontsteking compensatie. 0: steady state als er geen versnelling is ingeschakeld. lucht is ramped naar neutraal lucht en het contactslot gecompenseerd wordt gereduceerd tot nul. 1 : De gearlever is in versnelling, maar de versnelling is nog niet echt bezig. lucht is ramped tot station lucht en na een vertraging van de ontsteking is gedaald, zodat de dynamiek van de motor wordt gehandhaafd. 2: de versnellingsbak is eigenlijk ingeschakeld. lucht is nog ramped tot station de lucht en de ontsteking wordt snel ramped tot normale ontsteking. 3: het vistuig wordt vrijgezet. lucht is nog ramped, maar de ontsteking snel ramped tot het verkrijgen van een momentum afnemen. ";
