                        description = helptext = " 	Saves the obdEvap.LeakageResult for scantool evalutation, If there is a big leak the result is 1000. RANGE:			-3 - 4, 1000 UNIT: RESOLUTION:	1 UPDATE:			background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdTEngine_mAirperDegree":
                        description = helptext = " The factor from loadtable is multipliced with the matrix result. The factor is scale with 2 decimals. RANGE : 0 - 65536 UNIT : mg/C RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdStartTempState":
                        description = helptext = " This timer is running until lambda closed loop is entered. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MissfCal.CVSErrorLimStar":
                        description = helptext = " Limit for setting CVS misfire fault the first 1000 revs. Example: 3% misfire = 60 misfire in this limit. RANGE : 0 - 65535 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdTEngineLoadFac":
                        description = helptext = " On low/high loads the temp is slower/quicker than the matrix returns, therfor a factor from this table based on the result from matrix is used. RANGE : 0 - 32767 UNIT : RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdTEngStartCombFac":
                        description = helptext = " Get a start combustion from start temp. If a warm start, the combustion factor is valued higher (more combustions). RANGE : 0 - 32767 UNIT : RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdTEngCombust":
                        description = helptext = " Engine combustion support points to get correct amount of m_air from table. Due to interpolation routine can t handle 32 bits, the combustion counter can t be > 32000. Therefor local comb counter is = ECMStat.n_Combustion / 2 RANGE : 0 - 32760 UNIT : comb RESOLUTION : 50% UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdTEngine_mAirComb":
                        description = helptext = " Switch points for TEngDiagCal.m_LoadFac table that gets correction factor for m_air/comb due to high/low loads. RANGE : 0 - 32000 UNIT : mg/comb RESOLUTION : 0.01 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Missf.DetectLevel":
                        description = helptext = " This variable shows information from the combustion. It s updated from In.t_IgnDetect1 and In.t_IgnDetec2 depending on which cylinder is active. RANGE : 0-65535 UPDATED : every combustion ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.obdSTFT_m_AirInlet":
                        description = helptext = " The engine load is saved when the ShortTerm FuelTrim diagnose reports error. The data is used to determine whether we have entered the same drive condition or not during the next trip. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.p_TestBefThrottle":
                        description = helptext = " Contains the ign.off and ing.on test data of the bef throttle pressure sensor. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.FAdapWhenQAirError":
                        description = helptext = " Contains the mul fuel adap from when qairdiag reported error. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SyncProt.ST_SyncMode":
                        description = helptext = " Number of following combustions the engine have synced on. RESOLUTION : 1 combustion ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SyncProt.N_DecreaseCntr":
                        description = helptext = " Number of combustions to subtract from SyncCal.n_CombLimit after SyncCal.N_SyncMode1 number of engine cycles. RESOLUTION : 1 combustion ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SyncProt.ST_SyncDiagMode":
                        description = helptext = " Status of the sync diagnose. 3: Engine not synced. Possible detect fault. 2: Engine synced. Possible cylinder fault. 1: Engine synced. No faults. 0: Diagnose not performed yet. RESOLUTION : 1 combustion ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SyncProt.ST_Det2Fault":
                        description = helptext = " Detect 2 fault 2: High fault 1: Low fault 0: No fault RESOLUTION : Fault / No fault ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOS_ExceptionReason":
                        description = helptext = " Indicate wat has caused a reset: 2 - Bus_error_handler 3 - Adress_error_handler 4 - Illegal_instruction_handler 5 - Zero_divide 6 - CHK_error_handler 7 - TRAPcc_handler 8 - Privilige_violation_handler 9 - Trace_handler 12 - Hard_bkpt 14 - Format_error 15 - Uninitialized_interrupt 16-48 - Other error ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOS_ExceptionAddress":
                        description = helptext = " This variable include the programcode address at which an exeption occured, like division by zero etc. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ExecCntrlOption.CMD_FuelPumpRelay":
                        description = helptext = " Pump trelay active from kw2000 control option. The pump is active in 15 sec, also if the diag communication is turned of. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOSCal.t_DetWinNormal":
                        description = helptext = " The detect window length before sync but after multiign. The actual detect window length is this value - VIOSCal.t_DetBefWin - 1. RESOLUTION: 0.1 ms ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Out.CMD_NCInhibit":
                        description = helptext = " DESCRITPION: Inhibit neutral control in order to adapt drive air or on high altitudes.	 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ActualIn.ST_TCSLdaTorqueReq":
                        description = helptext = " Actual status on the TCS torque request via CAN. 0 - not valid 1 - valid UPDATE : Every 20 ms ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ActualIn.X_ActGearTipin":
                        description = helptext = " Actual gear on automatic gearbox. 2 - Reverse 3 - Neutral 5 - Gear 1, with engine break 6 - Gear 2, with engine break 7 - Gear 3 8 - Gear 4 9 - Gear 5 11 - Gear 3, lock up 12 - Gear 4, lock up 13 - Gear 5, lock up 21 - Gear 1, without engine break 22 - Gear 2, without engine break 27 - Gear 3, slipping lockup 28 - Gear 4, slipping lockup 29 - Gear 5, slipping lockup  ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "VIOSCal.t_BefDetWin":
                        description = helptext = " The time between the ign trigg start flank and start of the detect win. RESOLUTION: 0.1 ms ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SyncProt.ST_Det1Fault":
                        description = helptext = " Detect 1 fault 2: High fault 1: Low fault 0: No fault RESOLUTION : Fault / No fault ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ActualIn.ST_TCMIntervTyp":
                        description = helptext = " TCM torque request intervention type 0 = No intervention 1 = Reduce torque 								 2 = Increase torque ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ActualIn.ST_TCMShiftPatt":
                        description = helptext = " Active TCM shift pattern 0 = ECO 1 = Pwr 2 = Wusp 3 = Wnt 4 = US1 5 = US2 6 = Hot1 7 = Hot2 8 = Jerk 9 = Rep 10 = DS 11 = Tap U/D ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_ThrottleLimpHome":
                        description = helptext = " Indicate if throttle is in limphome 1 => Throttle is in limphome. 0 => Throttle is not in limphome. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "FlashSave.ST_GasHybridAct":
                        description = helptext = " When this flag and OBDAdap.ST_ActiveDiagSystem == LOBD the system will fit to a gas/gasoline converted car (used by Saab France). Following is different from a normal system when this flag is set: - The injectordriver diagnostic is disabled and this fault indication will only stop lambdacontrol (gas system is active). - Multiignition is only active during start and not when engine speed drops below 450 rpm. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "In.X_ActGearTipin":
                        description = helptext = " Actual gear on automatic gearbox. 2 - Reverse 3 - Neutral 5 - Gear 1, with engine break 6 - Gear 2, with engine break 7 - Gear 3 8 - Gear 4 9 - Gear 5 11 - Gear 3, lock up 12 - Gear 4, lock up 13 - Gear 5, lock up 21 - Gear 1, without engine break 22 - Gear 2, without engine break 27 - Gear 3, slipping lockup 28 - Gear 4, slipping lockup 29 - Gear 5, slipping lockup  ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ExecCntrlOption.ThrPWMActive":
                        description = helptext = " This flag indicates if the diagnostic current control of the throttle H-bridge is active. This is done by local id control option on the Out.AD_ThrottleDemand. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "HardwareRevision":
                        description = helptext = " Hardware revision letter. Example, in a 7.7B unit will the byte in this string be ascii B ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ActualIn.ST_TCMFreezeFrameReq":
                        description = helptext = " Request to send Powertrain Freeze Frame to TCM UNIT : bool (0 = off, 1 = on) MAX : 1 MIN : 0 TRANS : V = P RESOLUTION : 1 UPDATE : x ms ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnDef.MulIgnPulses":
                        description = helptext = " Max number of multi ignition pulses in 60 degree window when multi ignition mode is enabled: ( 60degress in time - t_DetWinMulti) / (IgnDef.t_TriggerHigh + t_TrigLow)  This symbol is max limited to IgnDefProt.MaxMultiPulses. RANGE : 1 - 255 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Sync.ST_DICFault":
                        description = helptext = " Fault information from the sync diagnose. RESOLUTION : 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "GearAdap.ST_TractionControl":
                        description = helptext = " Adaptive storage for ECMStat.ST_TractionControl. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnDef.IgnActive":
                        description = helptext = " Normal or multi ignition is active, ignition trigger output pin is low (it s also active during multi ignition burst ).  RANGE : 0 - Not active 1 - Active ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnDef.CntLowTrigg":
                        description = helptext = " Counts if ignition trigg is low when Multi Ignition 60degree window ends. If this increases a new calibration should be done. RANGE : 0-65535 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Sync.ST_DICDiagPerformed":
                        description = helptext = " Tells if the sync diagnose has been performed. 1: Diagnose has been performed. 0: Diagnose has not been performed yet. RESOLUTION : 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PLT_TriggDelay":
                        description = helptext = " * * Warning, check if this symbol is displayed correctly * * ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "GearAdap.ST_CruiseIncluded":
                        description = helptext = " Adaptive storage for ECMStat.ST_CruiseIncluded. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_CruiseIncluded":
                        description = helptext = " Indicates if cruise is present in the system. If the cruise lamp ones have been active will this flag be set and newer cleared. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICRun.ST_EngRunDiag":
                        description = helptext = " Engine running diagnos ready for evaluation. RANGE : 0 - Not Ready 1 - Diagnose started 2 - Diagnose data sampling finished 3 - Diagnose stopped 4 - Diagnose done ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.N_KnkBank1Low":
                        description = helptext = " Counts number of detections when In.U_KnockDiag is below the limit KnockDiagCal.errorLevel. This counts for all cylinders for a 4 cylinder engine and counts for (bank 1) cylinder 1,3 and 5 for V6 engine. RANGE : 0 - 255 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.N_KnkBank2Low":
                        description = helptext = " Counts number of detections when In.U_KnockDiag is below the limit KnockDiagCal.errorLevel. This counts only for (bank 2) cylinder 2,4 and 6 for V6 engine. RANGE : 0 - 255 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICRun.ST_MisfStarted":
                        description = helptext = " Misfire diagnose is started, this is a pre condition for engine running diagnose. RANGE : 0 - Not Ready 1 - Started ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICRun.ST_FuelCut":
                        description = helptext = " If FCut.CutStatus is indicated a fulcut then this variable is set to FCut.CutStatus. This variable is cleared in diagnose function which operate in background when FCut.CutStatus is 0. The delay Before the variable is change is approx 100ms. RANGE : 0 - No fuel cut >0 - read FCut.CutStatus ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_OfDiagnosis":
                        description = helptext = " Status of diagnose. Shows latest condition of the diagnose. This variable is set to 0 in ignition off. The variable status is set every time when a engine running diagnose is done Fault status could be set in cranking or sync diagnose also. RANGE : 0 - Diagnose is not done once 1 - OK, 2 - Fault found ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_CrankDiag":
                        description = helptext = " Cranking diagnos ready for evaluation. RANGE : 0 - Not Ready 1 - Diagnose started 2 - Diagnose data sampling finished 3 - Diagnose stopped 4 - Diagnose done ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_PreCondOK":
                        description = helptext = " Status if pre condition was OK in engine cranking diagnose. RANGE : 0 - Not OK 1 - Pre condition was OK ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_BreakCond":
                        description = helptext = " Status if break condition was detected in engine cranking and sync diagnose. RANGE : 0 - No break 1 - Break condition detected ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_SyncDiag":
                        description = helptext = " SyncDiag diagnos ready for evaluation. RANGE : 0 - Not Ready 1 - Diagnose started , conditions OK 2 - Diagnose data sampling finished 3 - Diagnose stopped 4 - Diagnose done ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_CrankKnk":
                        description = helptext = " Cranking diagnos ready for evaluation on Knock diagnose signals. RANGE : 0 - Not Ready 1 - Done ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICass.ST_CrankMisf":
                        description = helptext = " Cranking diagnos ready for evaluation on misfire dignose signals. RANGE : 0 - Not Ready 1 - Done ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmThrottleAreafilte":
                        description = helptext = " ActualIn.A_Throttle >= QAirDiagCal.minArea and ActualIn.A_Throttle <= QAirDiagCal.maxArea RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmHiSpeedTimerFilte":
                        description = helptext = " if HiSpeedStartTimer >= QAirDiagCal.timeToStart RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmLoadfilterOK":
                        description = helptext = " In.p_AirInlet <= QAirDiagCal.maxLoad and In.p_AirInlet >= QAirDiagCal.minLoad RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmPDiffFilterOK":
                        description = helptext = " MAF.p_InlBefQuote >= QAirDiagCal.minPDiff and MAF.p_InlBefQuote <= QAirDiagCal.maxPDiff RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmRPMfilterOK":
                        description = helptext = " In.n_Engine <= QAirDiagCal.maxRPM and In.n_Engine >= QAirDiagCal.minRPM RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmThrottleAreaAdpCo":
                        description = helptext = " During Throttle adaption or if adaption not has been performed once, the QAirInlet diagnose is restarted until pre conditions is OK. RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdAirmTempfilterOK":
                        description = helptext = " In.T_Engine >= QAirDiagCal.T_MinForTest and In.T_Engine <= QAirDiagCal.T_MaxForTest RANGE : 0 - 1 UNIT : BIT UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "catStatusReadyTimerOk":
                        description = helptext = " Ready timer is ok and monitoring of the second oxygen sensor signal is allowed . ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CatDiagLevProt.nrOfLambdaSwitches":
                        description = helptext = " Indicates the nr of lambda switches done during meanvalue calc. of lambda integrator. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CatDiagLevProt.preConditionOK":
                        description = helptext = " Indicates that the precondition for the diag are fulfilled. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CatStableOK":
                        description = helptext = " Indicates when the conditions except dutycycle and periodtime has been OK during a cal. time. (CatDiagCal.StableTimeLim) ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdCatDiagLevActive":
                        description = helptext = " Indicates for the lambda and purge regulation that the diagnose is active. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MissfCal.pAirInletDiffFilterON":
                        description = helptext = " Switch on/off misfire pairinletdiff filter RANGE : 0 or 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MissfCal.TransientFilterON":
                        description = helptext = " Switch on/off misfire transient filter RANGE : 0 or 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MissfCal.PurgeDiagFilterON":
                        description = helptext = " Switch on/off misfire filter dependant on purge being activated by diagnose. RANGE : 0 or 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MissfCal.ST_PedalTriggFiltActive":
                        description = helptext = " Activates the pedal released trigg on the transient filters. RANGE: 0-1 RESOLUTION : 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MissfCal.O2AdjBlockErrLim":
                        description = helptext = " The number of block there MissfAdap.MissfTotCntCat > MissfCal.O2AdjMFErrLim and a new set of calibration for O2 sens rear adjustment. RANGE : 0 - 255 RESOLUTION : 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.compPBefIgnOffDone":
                        description = helptext = " Indicates if the pressure comparison has been done during ign of. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.compPAmbIgnOffDone":
                        description = helptext = " Indicates if the pressure comparison has been done during ign of. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.compPInletIgnOffDone":
                        description = helptext = " Indicates if the pressure comparison has been done during ign of. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.p_BefThrotPressureError":
                        description = helptext = " Indicates if the p_AirBefThrot diagnose has detected an error during the pressure comparison during ignition off. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.p_AmbientPressureError":
                        description = helptext = " Indicates if the p_Air diagnose has detected an error during the pressure comparison during ignition off. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.faultyBrakeCounter":
                        description = helptext = " Counts the number of fulty brakedowns in the brakelight diag. This result is kept as adaption data to be able to send to the scantool to indicate the latest testresult. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.MisfCVSErrorLastDriveCycle":
                        description = helptext = " Indicates if the misfire cvs diag reported error the last driving cycle. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.MisfTempErrorLastDriveCycle":
                        description = helptext = " Indicates if the misfire temps diag reported error the last driving cycle. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.p_AirQuickAdaptionDone":
                        description = helptext = " Indicates if a p_air sensor adaption without accureate t_engine has been done at least once. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.p_InletPressureError":
                        description = helptext = " Indicates if the p_AirInlet diagnose has detected an error during the pressure comparison during ignition off. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdap.p_AirAdaptionDone":
                        description = helptext = " Indicates if a p_air sensor adaption has been done at least once. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdPurge.BreakCondDurTes":
                        description = helptext = " 3 = obdFuelLevel.V_FuelTankFilt < EvapDiagCal.V_FuelMin 4 = obdFuelLevel.V_FuelTankFilt > EvapDiagCal.V_FuelMax RANGE : 1 - 255 UNIT : RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdPurge.BreakPreConditi":
                        description = helptext = " 1 = In.v_Vehicle > 0 2 = obdPurge.ST_NeedForSpeed 5 = obdPurge.ST_DiagDone 6 = obdCCV.DiagActive 7 = evapEnvironTempToLow 8 = Environ.inletAirStartTemp() < EvapDiagCal.T_LoLim 9 = Environ.inletAirStartTemp() > EvapDiagCal.T_HiLim 10 = Environ.engineStartTemp() < EvapDiagCal.T_LoLim 11 = Environ.engineStartTemp() > EvapDiagCal.T_HiLim 12 = obdEvap.n_BrakeChanges > pEvapTestCal->nrOfBrakeChangeLim 13 = (In.U_Batt <= 100) || (In.U_Batt >= 160) 14 = ECMStat.p_Diff > -200 15 = Purge.Status != 0 16 = Out_CMD_Purge.hasReportedFault 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->pAirAmbientDelta 19 = obdpTankAdap.ST_FirstTimeAfterPowerUp == false RANGE : 1 - 255 ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Missf.Detect1Active":
                        description = helptext = " This variable shows if misfire detection for cylinder 1 and 2 is active or for V6 cylinder 1 , 3 and 5. RANGE : 0 - Not active 1 - Active UPDATED : every combustion ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdMisfAdjustForO2RearSensor":
                        description = helptext = " Enables new calibration for AdjustForRearSond during misfire.  Enable : If there is more misfire (Missf.nrOfCountedMisfire) than cal. limit (MissfCal.O2AdjMFErrLim) during a misfire temp block, then increase a block error counter. When block error counter >= cal. limit, (MissfCal.O2AdjBlockErrLim) set this flag.  Disable : If there is less misfire (Missf.nrOfCountedMisfire) than cal. limit (MissfCal.O2AdjMFOKLim) during a misfire temp block, then increase a block OK counter. When block OK counter >= cal. limit, (MissfCal.O2AdjBlockOKLim) clear this flag. RANGE : 0-1 UNIT : BIT ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Missf.ST_WasTooCold":
                        description = helptext = " Flag to indicate if temperature conditions are fulfilled or not, according to ODB2 regulations. If so, misfire evaluation is performed. Only used for MY05 and later. RANGE : 0 - 1 UPDATED : Background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdMisfO2RearAdjBlockOKCnt":
                        description = helptext = " Block OK counter for AdjustForRearSond RANGE : 0-255 UNIT : BIT RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdMisfO2RearAdjBlockErrCnt":
                        description = helptext = " Block error counter for AdjustForRearSond RANGE : 0-255 UNIT : BIT RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.ST_EnableTipou":
                        description = helptext = " Enable tipout function 0 = Disable Tip-out 1 = Enable Tip-out ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.ST_EnableActG2":
                        description = helptext = " Enable the use of In.X_ActGearTipin and special engine break tipin maps. In.X_ActualGear and the normal maps for open converter is used when disabled. 0 = Disable engine break maps 1 = Enable engine break maps ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "a601_status":
                        description = helptext = " Requested status from the drive master output RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AreaAdap.ST_ForceAdapDon":
                        description = helptext = " ForceAdaption of throttle area has been performed once. UPDATE : 250ms ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirmassMaster_Status":
                        description = helptext = " Identification which select low/high function is active. RESOLUTION : 1 bit RANGE : no bit set => no function active bit 0 => driver pedal is active bit 1 => driver cruise is active bit 2 => select low limit wheel is active bit 3 => select high m_nlow is active bit 4 => select low m_nhigh is active  ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "m_DriverStatus":
                        description = helptext = " Requested status from the pedal map RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "m_nHighStatus":
                        description = helptext = " Requested status from the m_nhigh functions RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "m_RequestStatus":
                        description = helptext = " requested status from the airmass master.It s the gobal status for the airmass controller RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "m_nLowStatus":
                        description = helptext = " Requested status from the m_nlow functions RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "m_WheelStatus":
                        description = helptext = " Requested status from the wheel master RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "m_IdleStatus":
                        description = helptext = " Requested status from the idle speed functions RESOLUTION : 1 bit RANGE : 0 => not active  1 => open loop  2 => closed loop ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.v_FCODisable":
                        description = helptext = " below this vehicle speed deviation fco is disabled again RESOLUTION : 0.1 km/h RANGE : 0 - 25.5 km/h ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_LimWheelAct":
                        description = helptext = " Status showing which function is reducing airmass in Limit Wheel Master.  V = Max Vehicle speed limit request. T = Torque Master limit request. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_TorqMastAct":
                        description = helptext = " Status showing which function is limiting torque in Torque Master.  M = Manual gear box limitation. A = TCM limit request (Extern limit from bus). S = Automatic gearbox Stall limit request. T = TCS (traction control) limit request. E = Max Engine Torque limitation. R = Reverse limit request. N = Noise reduction limit request. D = Misfire diagnose limit request B = Brake limit request P = Diff Protection System limit request C = Engine temperature limit ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_NoIgnition":
                        description = helptext = " Status flag of ignitionretardation: 0 = Ignition retardation allowed 1 = Ignition retardation not allowed ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_LimEngTemp":
                        description = helptext = " Status flag of engine temperature torque reduction: 0 = reduction not allowed 1 = reduction allowed ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_filter_n_Eng":
                        description = helptext = " indicates if pointer TorqueProt.n_engfilt is filtered or not. 0: filter off, TorqueProt.n_engfilt = In.n_Engine10ms 1: filter on, TorqueProt.n_engfilt = average of In.n_Engine10ms during the last TorqueCal.nosample. (one sample per call of Torquemaster) ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TiCalcuCal.ms_InletUpdate":
                        description = helptext = " Update time of delta p_Inlet RANGE : 0 - 255 RESOLUTION : 1 ms ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.ST_AdaptAllowed":
                        description = helptext = " Indicate if new adaption is allowed, throttle must been closed between each adaption. UPPDATE : every 100 msec. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.NoiseRedAllowed":
                        description = helptext = " This flag indicates when noisereduction is allowed from the boostregulating point of view. When noisereduction is active we have full PWM on the APC and this can t be allowed by the boostregulator during certain circustances because there will be big overshoots in load then. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.ST_IgnOffsEnable":
                        description = helptext = " Torque Master Ignition Offset Status. 0 = Ignition Offset Disabled. 1 = Ignition Offset Enabled for all torque functions. 2 = Ignition Offs Enabled for all torque functions except ASR/TCS ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.EnableOverBoost":
                        description = helptext = " Enables overboost ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.ST_ACCrankDon":
                        description = helptext = " This flag will be set to 1 when the AC activation during engine crank is finsihed and normal AC-control is active. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt.ST_Transition_0_1":
                        description = helptext = " Indicates a pedal2 transition from non-idle into idle RESOLUTION : 0 => no transition in idle  1 => transition in idle ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt.ST_PedalIdleNew":
                        description = helptext = " New pedal2 idle information RESOLUTION : 0 => not in idle  1 => in idle ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt.ST_PedalIdleOld":
                        description = helptext = " Old pedal2 idle information RESOLUTION : 0 => not in idle  1 => in idle ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt1.ST_ThrottleIdle":
                        description = helptext = " Indicates that throttle is in idle position regarding throttle poti 1 RESOLUTION : 0 => not in idle  1 => in idle ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt1.ST_Transition_0_1":
                        description = helptext = " Indicates a transition from non-idle into idle RESOLUTION : 0 => no transition in idle  1 => transition in idle ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt1.PedalDebounce":
                        description = helptext = " debouncing timer for safety switch pedal to indicate idle only the transition non-idle to idle has a debouncing time. RESOLUTION : 10 ms RANGE : 0 - 2550 ms  ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PedalMapProt.SentronicMo":
                        description = helptext = " Actual Sentronic mode (CR-934): 0 - Normal mode 1 - Ramping to Sentronic mode 2 - Sentronic mode active ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchProt.ST_ThrottleIdle":
                        description = helptext = " Indicates that throttle is in idle position by comparing throttle area (from poti 2) with the switchpoint area. RESOLUTION : 0 => not in idle  1 => in idle ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LambdaProt.HeatStateFront":
                        description = helptext = " The front heater runs throu 4 states with a specified PWM and time, both calibratible for each state (except fourth). The fourth state is always 100% PWM. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Lambda.ST_AdaptionAllowed":
                        description = helptext = " Indicate if the conditions for adapting the lambda regulation to the input from the rear lambda sensor. This variable is controlled in the catalyst diagnose.  ON => Adaption allowed.  OFF => Adaption not allowed. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PurgeProt.LocalMaxFuelFa":
                        description = helptext = " Maximum allowed fuelfac at actual load/rpm. RANGE : -50.0 - 0.0 % RESOLUTION : 0.1 % ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PurgeCal.MaxAdpFreezeInd":
                        description = helptext = " Maximum allowed ratio between the time the purge adaption is frozen resp. unfrozen. RANGE : 0 - 0.99 RESOLUTION : 0.01 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PurgeCal.HCContEvapFiltF":
                        description = helptext = " Filter factor for HC adaption during tank diagnosis. RANGE : 0 - 8 RESOLUTION : 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LambdaCal.ST_LambdaDurTrans":
                        description = helptext = " 1 = Closed loop during throttle transient if cooling temp are above TempTrans .  0 = Open loop during throttle transient. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "n_FuelCalc":
                        description = helptext = " Number of fuelfactor functions called from FuelMaster. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ExhaustCal.ST_JerkEnable":
                        description = helptext = " DESCRITION: Flag to enable jerk enrichment on automatic cars. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffProt.ST_LOStAftPowUp":
                        description = helptext = " Set to 1 if LO has started after powerup ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdaptCal.ST_SmartGuess":
                        description = helptext = " 0- Smart guess disabled. 1- Smart guess enabled. Added by MEA-TLn. RESOLUTION: ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.ST_EngTEnableKnk":
                        description = helptext = " 0- Engine temp below watertemp limit for knock control. 1- Engine temp above watertemp limit for knock control. Added by Mea-TLn 2001-02-23 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkProt.ST_NewAllowed":
                        description = helptext = " If new trigg of function are allowed. RANGE : 1 - Allowed. 0 - Not allowed. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnTempCal.ST_ActiveAtIdle":
                        description = helptext = " If this bit is set will the temp ignition be activated also at idle. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.ST_AllowRestart":
                        description = helptext = " 0: Lightoff ignition will be restarted only after an ECU powerdown (15-20 min Ignkey off). Following starts without preceeding powerdown will LO be disactiveted. 1: Lightoff ignition will be restarted at every engine restart if the normal lightoff conditions are OK. 2: Lightoff ignition will be restarted only after an ECU powerdown (15-20 min Ignkey off). If engine is restarted before IgnLOffProt.NrCombustion is counted down to zero will it countinue with LO but no new value on IgnLOffProt.NrCombustion will be read. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "F_KnkDetCal.SteadySPerShort":
                        description = helptext = " Number of steady combustions needed to be able to set the Steadystate_Short flag. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "F_KnkDetCal.SteadySPeriod":
                        description = helptext = " Number of steady combustions needed to be able to set ST_SteadyState. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MIUErrorCountDone":
                        description = helptext = " This flag is set if one or more devicedriver faultindications for MIU have occured during active cpu powerup. RANGE : 0 - No fault 1 - Fault occured during active CPU powerup ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TCMErrorCountDone":
                        description = helptext = " This flag is set if one or more devicedriver faultindications for TCM have occured during active cpu powerup. RANGE : 0 - No fault 1 - Fault occured during active CPU powerup ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TCSErrorCountDone":
                        description = helptext = " This flag is set if one or more devicedriver faultindications for TCS have occured during active cpu powerup. RANGE : 0 - No fault 1 - Fault occured during active CPU powerup ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "QAirDiagCal.SampleInterval":
                        description = helptext = " Every xx sample taken there is a check that the meanvalue of the difference between HFM signal and simulated HFM signal is not above lim. The nr of samples between these checks are decided in this data. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "O2SensFreqCal.LoadCntDown":
                        description = helptext = " Step at negative counting RANGE : 0 - 256 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CatDiagLevCal.loadInc":
                        description = helptext = " Abort the diag if the load has increased more than this limit since diag start. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "O2SensFreqCal.PreMinFlanks":
                        description = helptext = " O2 Sensor Pre Cat. Min no of sensor signal flanks for OK criteria RANGE : 0 - 255 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICassCal.T_EngLimit":
                        description = helptext = " Engine coolant temperature limit, the diagnos is not started if In.T_Engine is below the limit. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DICassCal.U_BattLimit":
                        description = helptext = " Battery voltage limit, the diagnos is not started if In.U_Batt is below the limit. ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdTEngTempChange":
                        description = helptext = " If the In.T_Engine diffs between obdStartTemp >= TEngDiagCal.n_deadDiffLim and vehicle speed > 0 then this variable is set. It s erased when ignition off. RANGE : false - true UNIT : RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdpTank.p_MeasurementRe":
                        description = helptext = " 	Result from fuel tank pressure measurement. It can be : 0 OKAY 1 NOTOK 4 INTERRUPTED RANGE :	0 - 4 UNIT :	Status RESOLUTION :	1 UPDATE :	background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdpTank.ST_ReportedErro":
                        description = helptext = " 	Show the current reported fault in pTank 0 - no error detected 5 - PTANK LOW 6 - PTANK HI 7 - PTANK RANGE RANGE :	0 - 7 UNIT :	Status RESOLUTION :	1 UPDATE :	background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdpTankAdap.ST_FirstTim":
                        description = helptext = " 	When ECU boots this variable will be set to 1 and cleared at ignition. RANGE :	0 - 1 UNIT :	Status RESOLUTION :	1 UPDATE :	background and when ECU boots ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdFuelLevel.ST_CheckDon":
                        description = helptext = " 	10 s after start and if fuel level is 10 l more than last reference (probably filled fuel during ignition off). Update reference with current fuel volume else use saved reference. RANGE :	0 - 1 UNIT :	Status RESOLUTION :	1 UPDATE :	background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdFuelLevel.ST_Activity":
                        description = helptext = " 	When fuel level diff from start is bigger than FuelLevelCal.V_ActivityCheck this variable is set. RANGE :	0 - 1 UNIT :	Status RESOLUTION :	1 UPDATE :	background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDCal.evapEquipmentExist":
                        description = helptext = " This flag indicates if the fueltankpressure sensor and the canister close valve exist in the car. RANGE : 0 - 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDCal.prelFaultCountDown":
                        description = helptext = " When this flag is set, preliminary faults will not be erased upon an OK report. Instead the faults faultcounter will be decremented. RANGE : 0 - 1 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EvapDiagCal.p_Ramp0MaxDi":
                        description = helptext = " 	This change in the fueltank pressure is allowed. (independant of expected direction of the pressure ramp). THIS ONLY VALID FOR RAMP0 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EvapDiagCal.Ramp2allFuel":
                        description = helptext = " 	This change in the fueltank pressure, opposite to the expected pressure ramp, is allowed. If the pressure ramp is expected to be positive the pressure is allowed to decrease this amount between two readings. THIS ONLY VALID FOR RAMP2 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EvapDiagCal.Ramp0allFuel":
                        description = helptext = " 	This change in the fueltank pressure, opposite to the expected pressure ramp, is allowed. If the pressure ramp is expected to be positive the pressure is allowed to decrease this amount between two readings. THIS ONLY VALID FOR RAMP0 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdapEvap.N_OutOfLimTe":
                        description = helptext = " 	Every time that precondition has been fullfiled except the temperature limit, this counter will be increased. When counter >= 3 the diagnose will report readiness. It s cleared when diagnose reports either fault or ok; RANGE:			0-255 UNIT: RESOLUTION:	1 UPDATE:			background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "OBDAdapEvap.Evap2BigResD":
                        description = helptext = " 	This counter will increase if the leakageresult i evap diagnose is a bigger diff than 2 compared to the last result in EvapStack and the result will not be inserted to the stack. Next time a diagnose has performed the result will automaticly be inserted due to this counter > 0. It will be set to 0 when a value is inserted into the stack. RANGE:			0 - 1 UNIT: RESOLUTION:	1 UPDATE:			background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EvapDiagCal.p_Ramp2MaxDi":
                        description = helptext = " 	This change in the fueltank pressure is allowed. (independant of expected direction of the pressure ramp). THIS ONLY VALID FOR RAMP2 ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TEngDiagCal.n_deadDiffLi":
                        description = helptext = " When engine start temp (obdStartTemp) differs more than this limit, the Tengine signal is alive, else it s dead. RANGE : 0 - 255 UNIT : RESOLUTION : 1 UPDATE : background ] ";
                        //category = XDFCategories.Undocumented;
                        //subcategory = XDFSubCategory.Undocumented;
