                        description = helptext = "Comfort factor for state 5 percentage of a_Request1 if you are in state 5. Resolution is %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.ComFac_6":
                        description = helptext = "Comfort factor for state 6 percentage of a_Request1 if you are in state 6. Resolution is %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.ComFac_7":
                        description = helptext = "Comfort factor for state 7 percentage of a_Request1 if you are in state 7. Resolution is %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.InitTapUp":
                        description = helptext = "Minimum initialization pulse for tap up if pulse will be generated. Resolution is Nm(wheel).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.InitTapUp54":
                        description = helptext = "Minimum initialization pulse for tap up if pulse will be generated Tapup button must be released after delay. Resolution is Nm(wheel).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.InitAcc":
                        description = helptext = "Minimum initialization pulse for acceleration via tap up button. Resolution is Nm(wheel).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.InitTapDown":
                        description = helptext = "Minimum initialization pulse for tap down if pulse will be generated. Resolution is Nm(wheel).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_RoadSize":
                        description = helptext = "Number of support points for default roadload map";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.v_Actual":
                        description = helptext = "Support points for actual vehicle speed. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_RoadTorque":
                        description = helptext = "Output of the default roadload map scaled to wheel torque. Resolution is Nm(wheel).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.TimerLimit":
                        description = helptext = "Timerlimit to decrease M_DeltaRoad for roadload calculation if brake signal is active to set M_RoadLoad1 to default roadload. Resolution is 0.1 sec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_DeltaRamp":
                        description = helptext = "Ramp for M_DeltaRoad which get active after RoadTimer > TimerLimit to set M_RoadLoad1 to default roadload. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_MinSize":
                        description = helptext = "Number of support points for offset to engine torque to limit the integrator";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.v_Delta":
                        description = helptext = "Support points for offset to engine torque to limit the integrator. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_Offset":
                        description = helptext = "Torque offset to actual engine torque to limit the integrator. Resolution is 1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseComCal.M_Minimum":
                        description = helptext = "Minimum engine torque to limit the integrator. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseFilterCal.t_592Deb":
                        description = helptext = "Time to debounce the cc_allowed info from the 592. Resolution is 1 bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseFilterCal.m_CCFilt":
                        description = helptext = "Filterconstant for actual airmass which is requested from cruise control. Resolution is 1 bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseFilterCal.M_Filter":
                        description = helptext = "Filterconstant for actual road load torque. Resolution is 1 bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseFilterCal.a_Filter":
                        description = helptext = "Filterconstant for actual accelaration. Resolution is 1 bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CruiseFilterCal.v_Filter":
                        description = helptext = "Filterconstant for actual vehicle speed. Resolution is 1 bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxVehicCal.Status":
                        description = helptext = "Requested status from the maximum vehicle speed limitation. Resolution is \"0\" => not active.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxVehicCal.v_Hysteresis":
                        description = helptext = "Hysteresis where max. speed limitation is active The function is active if actual speed > MaxVehicleCal.v_MaxSpeed and will be not active if actual speed < MaxVehicleCal.v_MaxSpeed - MaxVehicleCal.v_Hysteresis. Resolution is 1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxVehicCal.v_MaxSpeed":
                        description = helptext = "Vehicle speed limit where the functions max.vehicle speed limit is active. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCCal.M_DeltaWheelMin":
                        description = helptext = "Minimum M_DeltaWheel if v_Deviation is higher than v_Threshold and unsigned actual M_DeltaWheel is lower than M_DeltaWheelMin The sign will com from sign of v_Difference. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCCal.v_Threshold":
                        description = helptext = "If actual v_Deviation is higher than v_Threshold and unsigned actual M_DeltaWheel is lower than M_DeltaWheelMin M_DelatWheel = M_DeltaWheelMin.The sign for minimum M_DeltaWheel will come from the sign of v_Difference. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCCal.v_USDOffset":
                        description = helptext = "Offset where the function Under Schedule Disengage will be enabled.If the actual speed is >= v_request - offset the functions is enabled. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCCal.v_USDMin":
                        description = helptext = "Minimum USD speed.If actual < v_request - v_USD the cruise will be switched off.The minimum v_USD will be v_USDMin. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ShiftSupCal.M_RLoadSP":
                        description = helptext = "Support points for M_HystTab. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ShiftSupCal.M_HystTab":
                        description = helptext = "Hysteresis used to avoid a decrease of X_Offset (and a shift up) before there are engine torque available to shift up. This value shall be the extra engine torque needed to shift up plus an offset. When the max engine torque (converted to wheel torque) is greater than actual integrator plus hysteresis (converted to wheel torque), X_Offset is decreased (ramp down) to make a gear shift up. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ShiftSupCal.X_AccLim":
                        description = helptext = "This condition (and a number of other) that has to be fulfilled before starting to ramp up the Gear shift support offset making Out.X_AccPedal to increase and forcing the automatic gear box to shift down The CruiseProt.a_Actual must be lower than this percent of CruiseProt.a_Requested before the offset is incremented. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ShiftSupCal.a_Offset":
                        description = helptext = "This condition (and a number of other) that has to be fulfilled before starting to ramp up the Gear shift support offset making Out.X_AccPedal to increase and forcing the automatic gear box to shift down The CruiseProt.a_Actual must be lower than this absolute value before the offset is incremented. Resolution is 0.01 m/s°.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.Hysteresis":
                        description = helptext = "Hysteresis for gear ratio before the actual ratio is set to the new one.This ratio is only used to convert M_Wheel to M_Engine. Resolution is 1 Bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.FilterRamp":
                        description = helptext = "Ramp of filter constant for gear ratio if system changes from not lockup to lockup. Resolution is 1 Bit / 50ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.NotLockFactDy":
                        description = helptext = "Filter constant for not lockup in automatic cars to filter gear ratio if cruise status is in resume mode(NormalMode == 0)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.LockUpFact":
                        description = helptext = "Filter constant for lockup in automatic cars to filter gear ratio";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.NotLockFactSt":
                        description = helptext = "Filter constant for not lockup in automatic cars to filter gear ratio if cruise status is in normal mode(NormalMode == 1)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CCRatioCal.NotCruiseFact":
                        description = helptext = "Filter constant for non cruise mode and manual cars to filter gear ratio";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSProt.v_GearBoxOut":
                        description = helptext = "TCM gearbox output speed converted to vehicle speed. Resolution is 0.1 km/h. Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSProt.v_Diff":
                        description = helptext = "Speed differance between the gearbox out speed and one front wheel. Resolution is 0.1 km/h. Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSProt.M_Limit":
                        description = helptext = "Engine torque limitation not adjusted for - delay time - change delta limitation. Resolution is 1 Nm. Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSProt.t_StartTimer":
                        description = helptext = "Time when torque limitation became active ( ST_LimActive == 1 ). Resolution is 1 ms. Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSProt.t_Delay":
                        description = helptext = "Delay time = f (Out.M_Engine) Time before torque limitation is activated. Resolution is 1 ms. Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSProt.ST_LimActive":
                        description = helptext = "DPS torque limitation status flag Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPS.M_Limit":
                        description = helptext = "Maximum engine torque from the diff protection system to limit wheel master. This limit is the result from DiffPSCal.M_LimitTab but are limited in change delta by DiffPSCal.DiffPSCal.M_PosRampMax and DiffPSCal.DiffPSCal.M_NegRampMax. If the v_GearBoxOut = 0, this limit will be set to 400 Nm. Resolution is 1 Nm. Interval is Every 100ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.SpeedDivFac":
                        description = helptext = "Division factor to recalculate the gearbox speed from VBUS to km/h. In.v_GearBoxOut * 128 DiffPSProt.v_GearBoxOut = DiffPSCal.SpeedDivFac";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.v_DiffSP":
                        description = helptext = "Speed differance supportpoints for calculation of max diff protection torque. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.M_LimitTab":
                        description = helptext = "Maximum engine torque = f(v_Diff). Max engine torque for the diff protection system depending on speed differance between gearbox speed and one front wheel speed. This torque is sent to the limit wheel master. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.M_PosRampMax":
                        description = helptext = "The positive change of DiffPS.M_Limit is limited by this torque step every 100ms. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.M_NegRampMax":
                        description = helptext = "The negative change of DiffPS.M_Limit is limited by this torque step every 100ms. But if the actual torque Out.M_Engine + 40Nm is lower than the limitation will this negativ max ramp not be used and DiffPS.M_Limit is set to Out.M_Engine. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.M_EngineSP":
                        description = helptext = "Actual engine torque supportpoints for calculation of delay time before limitation of the engine torque. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.t_LimDelayTab":
                        description = helptext = "Torque limitation delay time = f(Out.M_Engine). Engine torque limitation for the protection of the differential gear is delayed a calibrational time depending on actual engine torque. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DiffPSCal.v_MaxActive":
                        description = helptext = "Maximum speed that will enable the diff protecting system. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLim.ST_GearShifting":
                        description = helptext = "This flag is set when the clutch is pressed. Either by detect the In.ST_ClutchBrake1 or by detection of a change in gear ratio after the pedal is released below 10%. When this flag is set will the air antijerk be disabled.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLim.RatioDelta":
                        description = helptext = "Absolute delta of the EmLimProt.RatioFilt, used to detect stable ratio after a gearshift or to detect a gear shift Interval is Every 20 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimProt.Ratio":
                        description = helptext = "Actual gear ratio value used to detect gearshifting on manual cars for air antijerk and fast/slow tipout. Calculated as followed: Rpm * 128 ratio = km/h * 10 Interval is Every 20 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimProt.RatioFilt":
                        description = helptext = "Filtered EmLimProt.Ratio The filterfactor used for this data is EmLimCal.FiltFac Interval is Every 20 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimProt.RatioHigh":
                        description = helptext = "When the simulated clutch detection is active is this limit used to set a high limit for the change in gear ratio. EmLimProt.RatioHigh = EmLimProt.RatioFilt * EmLimCal.GrShftRatioHigh";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimProt.RatioLow":
                        description = helptext = "When the simulated clutch detection is active is this limit used to set a low limit for the change in gear ratio. EmLimProt.RatioLow = EmLimProt.RatioFilt * EmLimCal.GrShftRatioLow";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimCal.GrShftRatioHigh":
                        description = helptext = "When the acc pedal is released below 10% is this factor once multiplied with the filtered gear ratio, to make a high limit for detection of a change in gear ratio. If the filtered ratio is abowe that limit will the EMLim.ST_GearShifting be set. EmLimProt.RatioHigh = EmLimProt.RatioFilt * EmLimCal.GrShftRatioHigh";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimCal.GrShftRatioLow":
                        description = helptext = "When the acc pedal is released below 10% is this factor once multiplied with the filtered gear ratio, to make a low limit for detection of a change in gear ratio. If the filtered ratio is below that limit will the EMLim.ST_GearShifting be set. EmLimProt.RatioHigh = EmLimProt.RatioFilt * EmLimCal.GrShftRatioHigh";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimCal.FiltFac":
                        description = helptext = "Filter factor used for the gear ratio. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> EmLimProt.RatioFilt old_value -> old EmLimProt.RatioFilt new_value -> EmLimProt.Ratio Const -> EmLimCal.FiltFac If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EmLimCal.ClutchMode":
                        description = helptext = "Mode selection on how to set the gearshifting flag, EmLim.ST_GearShifting. Modes: 0 - Use only the In.ST_ClutchBrake1 1 - Use both the In.ST_ClutchBrake1 and if the clutch is pressed for more than EmLimCal.t_ClutchDelay ms, start the gear ratio gearshift detection. 2 - Use only the gear ratio gearshift detection. Gear ratio gearshift detection: When the pedal is released below 10% is a high and low ratio limit calculated, EmLimProt.RatioLow and EmLimProt.RatioHigh, when the ratio is above the high limit or below the low limit is the EmLim.ST_GearShifting flag set. When the pedal is above 5% and a gear is detected and the EmLimProt.RatioDelta is below 5 will the EmLim.ST_GearShifting flag be cleared.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.ST_Enable":
                        description = helptext = "Possibility to deactivate the crank case ventilation valve control. 0 = Crank Case Ventilation Valve function OFF Diagnose disabled. 1 = Crank Case Ventilation Valve function ON Diagnose enabled.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.p_DiffLimit":
                        description = helptext = "Pressure limit. As long as In.p_Air < In.p_AirInlet + CrnkCVCal.p_DiffLimit + CrnkCVCal.p_DiffLimitHys the crank case ventilation valve will be open. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.p_DiffLimitHys":
                        description = helptext = "Hysteresis to avoid valve to flip / flap. When the crank case valve is open: CrnkCVProt.p_DiffLimit = CrnkCVCal.p_DiffLimit + CrnkCVCal.p_DiffLimitHys. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.Q_AirLimit":
                        description = helptext = "Air flow limit. As long as In.Q_AirInletFilt > CrnkCVCal.Q_AirLimit - CrnkCVCal.Q_AirLimitHys the crank case ventilation valve will be open. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "CrnkCVCal.Q_AirLimitHys":
                        description = helptext = "Hysteresis to avoid valve to flip / flap. When the crank case valve is open: CrnkCVProt.Q_Limit = CrnkCVCal.Q_AirLimit - CrnkCVCal.Q_AirLimitHys. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTip.m_TipInLimit":
                        description = helptext = "Maximum airmass increase level";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTip.m_TipOutLimit":
                        description = helptext = "Maximum airmass decrease level";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTip.ST_Active":
                        description = helptext = "Status flag showing if tipin is active 0 = Not active 1 = Tip-in active 2 = Tip-out active";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipProt.m_TipInRamp":
                        description = helptext = "Maximum increase of airmass at current airmass level.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipProt.m_TipOutRamp":
                        description = helptext = "Maximum decrease of airmass at current airmass level.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.X_TipInRFM0Tab":
                        description = helptext = "Increase maximum airmass ramp step at high airmass requests for manual gearbox and when the gear is undefined and during gear shift. Resolution is 0.01;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.X_TipInRFM1Tab":
                        description = helptext = "Increase maximum airmass ramp step at high airmass requests for 1st gear in a manual gearbox . Resolution is 0.01;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.X_TipInRFM2Tab":
                        description = helptext = "Increase maximum airmass ramp step at high airmass requests for 2nd gear in a manual gearbox . Resolution is 0.01;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.X_TipInRFM3Tab":
                        description = helptext = "Increase maximum airmass ramp step at high airmass requests for 3rd gear in a manual gearbox . Resolution is 0.01;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.X_TipInRFM4Tab":
                        description = helptext = "Increase maximum airmass ramp step at high airmass requests for 4th gear in a manual gearbox . Resolution is 0.01;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.X_TipInRFM5Tab":
                        description = helptext = "Increase maximum airmass ramp step at high airmass requests for 5th gear in a manual gearbox . Resolution is 0.01;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.m_TipInMan0Map":
                        description = helptext = "Maximum airmass increase matrix to avoid bad comfort (tipin). This matrix is chosen at gear shifts and undefinied gear";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.m_TipInMan1Map":
                        description = helptext = "Maximum airmass increase matrix to avoid bad comfort (tipin). This matrix is chosen at first gear. Resolution is 1 mg/c;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.m_TipInMan2Map":
                        description = helptext = "Maximum airmass increase matrix to avoid bad comfort (tipin). This matrix is chosen on second gear. Resolution is 1 mg/c;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.m_TipInMan3Map":
                        description = helptext = "Maximum airmass increase matrix to avoid bad comfort (tipin). This matrix is chosen at third gear. Resolution is 1 mg/c;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.m_TipInMan4Map":
                        description = helptext = "Maximum airmass increase matrix to avoid bad comfort (tipin). This matrix is chosen at fourth gear. Resolution is 1 mg/c;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "EngTipCal.m_TipInMan5Map":
                        description = helptext = "Maximum airmass increase matrix to avoid bad comfort (tipin). This matrix is chosen at fifth gear. Resolution is 1 mg/c;.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
