                    case "Idle.ST_Enable":
                        description = helptext = "Indicate if idlespeed regulation is active. \"ON\" - Idlespeed regulation active: Engine started, Vehiclespeed < 3km/h, In.X_AccPedal < IdleCal.X_AccPedalLim, engine speed difference not higher than IdleCal.n_EngDiffLim, engine speed delta not higher than IdleCal.n_EngDeltaLim and throttle not in limphome. \"--\" - Idlespeed regulation not active, only the constant part and adaption part are used. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.ST_AdapAllowed":
                        description = helptext = "Indicate if idle adaption is allowed. 1 - Idlespeed adaption allowed 0 - Idlespeed adaption not allowed Following conditions must be fullfilled to enable idle adaption: - Engine temp above limit - Not to high difference in rpm - idle I-part not limited: Idle air still greater than minload air, Throttle area > 10 mm2 I-part greater than -5.00 g/s I-part less than +5.00 g/s - No error on automatic Gear-Box drive signal (FaultIn.M_ExternLimitReq & 0xF0) = 0 - No lightoff offset, IdleProt.n_EngLOffOffset = 0 - No servopressure comp, LoadCo.ST_IdleAdapt = 0 - No fault on vehiclespeed, FaultIn.v_Vehicle = 0 - Lightoff rpm offset not active, IdleProt.n_EngLOffOffset = 0";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.StartAirMode":
                        description = helptext = "Indicate actual start mode. 1 - Rpm below nominal idle rpm + n_EngNomExtra - n_EngLOffOffset. The IdleProt.Q_StartOffs is used above idle adaption and constant part. The conversion from airmass to throttle area is done with fixed enginespeed (Nominal engine speed). 2 - The IdleProt.Q_StartOffs is ramped to zero. The condition to enter mode 0 is: IdleProt.Q_StartOffs=0 OR ( Engine speed drops below nominal idle rpm + IdleCal.n_EngNomExtra AND IdleProt.Q_StartOffs <= IdleCal.I_PartMax AND more than 10 combustions in mode 2 ) When the condition above is true will the rest of IdleProt.Q_StartOffs be copyed to the IdleProt.I_Part and idle control will be released. 0 - Engine running and the Q_StartOffs is not used anymore. Idle control is released.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.Q_Air":
                        description = helptext = "Actual airmass from idle controller, total sum of following regulator parts: IdleProt.C_Part IdleProt.P_Part IdleProt.I_Part IdleProt.D_Part IdleAdap.Q_Air(Neutral or Drive). Resolution is 0.01 g/s. Interval is 50 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Idle.n_EngineNominal":
                        description = helptext = "Actual nominal engine speed. When engine not is in idle mode will this variable be set to zero. Resolution is 1 rpm.";
