                        description = helptext = "Temporary storage of the constant and adaption part of the idle air. From this table the actual constant-adap idle air is interpolated depending on vehicle speed.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.State":
                        description = helptext = "Internal state in the state machine controlling the Drive Neutral air and ignition compensation. 0 : steady state when no gear is engaged. air is ramped down to neutral air and the ignition offset is reduced to zero. 1 : the gearlever is in gear position but the gear has not yet been actually engaged. air is ramped up to drive air and after a delay the ignition is decreased so the momentum from the engine is maintained. 2 : the gear is actually engaged. air is still ramped up to drive air and the ignition is rapidly ramped up to normal ignition. 3 : the gear is disengaged. air is still ramped up but the ignition is rapidly ramped down to obtain a momentum decrease.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.RampStart":
                        description = helptext = "Flag indicating the start time stamp of a ramp.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.RampTimer":
                        description = helptext = "Contains the time span for the ramp. Fetched from a cal table.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.RampFinished":
                        description = helptext = "Flag indicating that the ramp is finished.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.ActiveAirRampTimer":
                        description = helptext = "Contains a time stamp when the active air ramp starts. The active air ramp is a function which lets the air amount vary as function of quote between gearbox rpm and engine rpm. This function is needed to compensate the air if the gear is very slow to engage. The function is activated after a cal. time from when the gear starts to engage or disengage.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.I_PartStart":
                        description = helptext = "Contains the idle i_part when the neutral control is activated. During neutral control the i_part of the idle air control is moved to the constant and adap part of the drive-neutral compensation.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.VSpeedIn2":
                        description = helptext = "Flag indicating that there has been vehicle speed in state 2. This is used to shut off the active air ramping in state 2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "DNCompProt.GearActivatedIn2":
                        description = helptext = "Flag indicating that the gear has been fully activated in state 2. This is used to shut off the active air ramping in state 2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleAdap.Q_AirNeutral":
                        description = helptext = "Adaption value for idlespeed regulation (drive not activated). This value is added to the PID and Constant part of the regulator. If the I-part is limited will the adaption stop. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleAdap.Q_AirDrive":
                        description = helptext = "Adaption value for idlespeed regulation (drive activated). This value is added to the PID and Constant part of the regulator. If the I-part is limited will the adaption stop. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_DeltaSP":
                        description = helptext = "SP for the table from where the weight fac for the DN comp ign offset is fetched. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_DeltaTAB":
                        description = helptext = "Table from where the weight fac for the DN comp ign offset is fetched. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.IgnRampDelay":
                        description = helptext = "When the D/N air compensation is activated, wait this nr of ms before the ignition ramp is done. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.v_VehicleLim":
                        description = helptext = "Vehicle speed limits used to interpolate between drive and neutral C-part and adaption-part. Below the low speed limit is the drive part used and above the high limit is the neutral part used. This function is only activated on Automatic gearboxes. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.T_EngineSP":
                        description = helptext = "Engine temperature supportpoints for calculation of nominal idle speed. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngNomDrive":
                        description = helptext = "Nominal engine speed depending on watertemperature when the Drive signal is activated on automatic gearboxes. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngNomNeutral":
                        description = helptext = "Nominal engine speed depending on watertemperature when no Drive signal is activated. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.C_PartNeutral":
                        description = helptext = "Constant part of idle regulator depending on the engine temperature (drive not activated on cars with automatic gearboxes). Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.C_PartDrive":
                        description = helptext = "Constant part of idle regulator depending on the engine temperature (drive activated on cars with automatic gearboxes). Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_StartOffsTab":
                        description = helptext = "Extra Q-air offset used during start. This value will be added to the idle constant and adaption part. Until engine started flag is set and rpm is abowe nominal engine speed, will the nominal engine speed be used for Q to m and m to area conversion. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.DelayDriveAct":
                        description = helptext = "Delay time before the drive Q is activated.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.DelayDriveRel":
                        description = helptext = "Delay time before the drive Q is released and neutral Q is used.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngDiffSP":
                        description = helptext = "Support points for StartRedFacTab. Difference between actual rpm and nominal idle rpm. diff = In.n_Engine - Idle.n_EngineNominal. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngNomExtra":
                        description = helptext = "Extra rpm above nominal idle speed to stop the Q_StartOffs ramp. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.I_PartSP":
                        description = helptext = "Engine speed difference support points for I part table. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.I_PartTab":
                        description = helptext = "I part of idlespeed regulator depending on enginespeed difference. The I-part is not allowed to decrease if idle airmass is lower than minload airmass or if Out.A_ThrottleDemand <= 10 mm2. If the I-part is limited will the idle adaption be stopped. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.P_PartSP":
                        description = helptext = "Engine speed difference support points for P part table. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.P_PartTab":
                        description = helptext = "P part of idlespeed regulator depending on enginespeed difference. IdleProt.n_EngineDiff * X IdleProt.P_Part = 1000 (X is the result of this map)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.X_AccPedalLim":
                        description = helptext = "If Out.X_AccPedal is lower than this limit is the flag for released pedal set. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.X_AccPedalLim2":
                        description = helptext = "If Out.X_AccPedal is higher than this limit is the flag for released pedal cleared. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngDeltaLim":
                        description = helptext = "Max engine speed delta to activate idlemode. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngDiffLim":
                        description = helptext = "Max engine speed difference between actual enginespeed and nominal idle speed to activate idlemode. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.AdapDelay":
                        description = helptext = "Delay time between every adaption adjustment within correct adaption conditions. This time must be longer than the I-part delay time \"I_PartDelay\". Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.T_EngineLimit":
                        description = helptext = "Below this engine temperature limit is not idle adaption allowed. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngAdapLim":
                        description = helptext = "Engine speed difference between actual value and nominal engine speed must be below this value to enable the idle adaption. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.I_PartDelay":
                        description = helptext = "Delay time between every adjustment of the regulator I-part. Used to obtain higher. Resolution on the I-part. This time must be shorter than the adaption time \"AdapDelay\". Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.I_PartDelay2":
                        description = helptext = "Delay time between every 0.05 g/s decrement of the I-part when idle control is disabled and the I-part is ramped down to IdleCal.I_Part. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.LOffSP":
                        description = helptext = "Support points for extra Q-air depending on ligh off ignition offset. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.LOffTab":
                        description = helptext = "Extra Q-air offset depending on ligh off ignition offset. This value will be added to the idle regulator. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.I_Part":
                        description = helptext = "I-part value used as constant offset when the idle I-part not is active. When idle control is disabled and the actual I-part is lower than this value will this value be copyed to the actual I-part. If the actual I-part is greater than this value will the actual I-part be ramped down to this value with 0.01 g/s every 50ms. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.I_PartMax":
                        description = helptext = "During start owershot (Idle.StartAirMode=2) must the start air ramp down to at least this max value before the start air mode is set to 0 and start air is copyed to IdleProt.I_Part. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngDeltaLim2":
                        description = helptext = "Below this rpm delta limit is idle I-part activated if pedal is released, vehicle speed above 3km/h and no gear detected on manual gearbox or if vehicle speed is below v_VehicleLim2 on automatic gearbox or neutral is detected. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.v_VehicleLim2":
                        description = helptext = "If vehicle speed is below this limit on automatic gearbox or if no gear is detected on manual gearbox and pedal released, rpm delta below n_EngDeltaLim2 and vehicle speed above 3km/h is the idle I-part activated. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.LoopStatus":
                        description = helptext = "Demand open or closed throttle regulator loop. 0 - Idle part not active 1 - Idle demands open loop 2 - Idle demands closed loop";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.LoopStatusRamp":
                        description = helptext = "Demand open or closed throttle regulator loop during the start ramp (StartAirMode=2). 0 - Idle part not active 1 - Idle demands open loop 2 - Idle demands closed loop";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_StartOffsRamp":
                        description = helptext = "Additonal air increased on the start air if the engine speed is above 300 rpm during startmode 1. This is to make shore that the engine will reach nominal idle speed and enter startmode 2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_FirstDrvComp":
                        description = helptext = "Additonal drive air used only the first time drive is activated after 15 min ignition off. This air is ramped to zero by the Q_FirstDriveRamp decrement factor. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_FirstDrvCompRmp":
                        description = helptext = "Decrement air / 50ms until the extra first drive air is ramped to zero. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.ST_EnableLOffRpm":
                        description = helptext = "Flag to enable or disable the light off rpm offset function. 0 - > Function not active 1 - > Function active ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.ST_IdleMovCarMan":
                        description = helptext = "Flag to activate \"Idle moving car\" function on manual cars. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.T_EngineLOffSP":
                        description = helptext = "Engine temperature supportpoints for calculation of extra light off rpm offset. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngLOffDrive":
                        description = helptext = "Light off rpm offset depending on engine temperature when gearbox is in Drive position. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngLOffNeutral":
                        description = helptext = "Light off rpm offset depending on engine temperature when gearbox is in neutral position. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngLOffSP":
                        description = helptext = "Rpm offset support points for calculation of additional idle air during light off rpm offset. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_LOffRpmDrive":
                        description = helptext = "Extra light off air during increased rpm depending on actual rpm offset for light off. This table is used when automatic gearbox is in drive position. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_LOffRpmNeutral":
                        description = helptext = "Extra light off air during increased rpm depending on actual rpm offset for light off. This table is used when automatic gearbox is in neutral position or if manual gearbox.. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.v_VehicleLOffRamp":
                        description = helptext = "Above this vehicle speed limit will the light off rpm offset be decreased faster, with 1rpm every 50ms. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.LOffRampDelay":
                        description = helptext = "Delay time between every decrement of light off rpm offset \"IdleProt.n_EngLOffOffset\" when the vehicle speed is below \"IdleCal.v_VehicleLOffRamp\". Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.v_VehicLim":
                        description = helptext = "Vehicle speed limit for idle control. Idle control is disabled when vehicle speed is above this limit. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.p_AltStartSP":
                        description = helptext = "Altidude pressure support points for start air compensation. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_AltStartTAB":
                        description = helptext = "Extra air compensation for high altidudes This airflow is added to the normal start air compensation. IdleCal.Q_StartOffsTab result + IdleCal.Q_AltStartTAB result = IdleProt.Q_StartOffs . Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.T_AirSP":
                        description = helptext = "Inlet air temperature support points for T_AirTab. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.T_AirTab":
                        description = helptext = "Constant part of idle regulator depending on the air temperature. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.p_AirAmbSP":
                        description = helptext = "Ambient pressure support points for altitude compensation to idle air. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_AirAmbTab":
                        description = helptext = "Altitude compensation table to idle air. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.t_yaxis":
                        description = helptext = "Supportpointer for StartRedFacMat";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.StartRedFacMat":
                        description = helptext = "Decrement factor for Q_StartOffs, depending on rpm owershoot. newQ_Start = oldQ_Start * StartRedFac. Resolution is 0.001.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_GearboxDiff":
                        description = helptext = "The difference in n_GearboxDiff to indicate that the gear is beginning to be activated. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.NeutralAirPartTAB":
                        description = helptext = "The percent of the idle neutral air calibration data to use to get the total idle air, when neutral control is active. The rest is fetched from the idle drive air calibration. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngQuoteSP":
                        description = helptext = "The support points for the NeutralAirPartTAB. This is the quote between the In.n_GearBoxIn and the In.n_Engine. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.NCNegRate":
                        description = helptext = "The maximum allowed negative change for the constant idle air when neutral control is active. Resolution is 0.01.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.NCPosRate":
                        description = helptext = "The maximum allowed positive change for the constant idle air when neutral control is active. Resolution is 0.01.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.DNIndSampleTime":
                        description = helptext = "How often shall the gear box rpm be sampled to detect that the gear is beginning to be activated. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.ActiveAirRampTime":
                        description = helptext = "The delay before the air ramp is reactivated after state1-state2 and state3-state0 transition. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_TPartRamp":
                        description = helptext = "This calibration value will continuously ramp IdleProt.T_Part off from the first combustion until this value. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_LOffIdleStep":
                        description = helptext = "RPM ramp step that is taken every IdleCal.LOffRampDelay when speed of vehicle is below IdleCal.v_VehicleLOffRamp. Resolution is 0.1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_EngElevOff":
                        description = helptext = "Elevated Idle offset. This offset is added on to Idle.n_EngineNominal when In.ST_ElevatedIdle is active. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.T_EngRPMOffSP":
                        description = helptext = "Support points for idle offset matrix . Resolution is 1 C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_RPMOffYSP":
                        description = helptext = "Support points for idle offset matrix . Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.Q_IdleOffsMAP":
                        description = helptext = "Extra air to get to idle offset. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.X_mLOffHighAltTab":
                        description = helptext = "Decreased light off idle RPM air on high altitude depending on IdleProt.n_EngineDiff.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_RpmDiffLOffSP":
                        description = helptext = "Decreased light off idle RPM air on high altitude support table";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.N_LOffComb":
                        description = helptext = "The number of combustion after start to enable the decreased light off RPM air on high altitude";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.LOffFilterFactor":
                        description = helptext = "Filter factor for the high altitude compensation function Const range 0 - 9999 0 and 100 = 100% new_value 1 and 200 = 50% new_value 2 and 400 = 25% new_value 3 and 800 = 12.5% new_value 4 and 1600 = 6.25% new_value";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.ST_ElevIdleAct":
                        description = helptext = "Activte function with elevated idle on request from In.ST_ElevatedIdle";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.N_StartAirMode2":
                        description = helptext = "The minimum number of combustions in StartAirMode 2 before entering StartAirMode 0";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_LowIPart":
                        description = helptext = "Do not allow increase of I-part at engine speed lower than IdleCal.n_LowIPart";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.p_NCLim":
                        description = helptext = "Barometric air pressure when Out.CMD_NCInhibit gets set. To avoid troubles on high altitude with neutral control.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.n_IdleMovAutOffset":
                        description = helptext = "Extra offset added to the nominal engine speed when idle regulator is active and the car is moving. Used on automatic cars only.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.t_DelayDAdap":
                        description = helptext = "Delay before forced drive adaption. If no drive adaption is done after this time since start, neutral control will be inhibited until the adaption is done.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IdleCal.X_ActualGearLim":
                        description = helptext = "In.X_ActualGear must be over this limit for the \"Idle moving car function\" to be able to get activated.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnk.MaxAir":
                        description = helptext = "Max allowed airmass depending on knocking and max engine speed. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEng.ST_MaxLimActive":
                        description = helptext = "Status variable indicating which MaxLim is active (lowest) for the moment. 0 = Knock limit 1 = Max engine speed limit 2 = Performance control 3 = Max turbo speed limit 4 = Crank case ventilation faulty 5 = Faulty APC";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngProt.m_TurboSpeedMaxReq":
                        description = helptext = "Max allowed m_request depending on max turbo speed. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkProt.MapPointer":
                        description = helptext = "Pointer for calculation of max allowed airmass. This pointer are equal with mean value of knock ignition offset, but could been adjustet if one cylinder offset divided with constant are lower. Other offsets (Ign.fi_OtherOff) are also added to this pointer, including adjustment for index. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkProt.DivFactor":
                        description = helptext = "Factor used for calculation of MapPointer.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngCal.Status":
                        description = helptext = "Status off limit engine control.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngCal.p_AirSP":
                        description = helptext = "Ambient air pressure support points for max turbo speed. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngCal.TurboSpeedTab":
                        description = helptext = "Max allowed m_request depending on ambient air. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngCal.n_EngSP":
                        description = helptext = "Engine speed support points for max turbo speed. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LimEngCal.TurboSpeedTab2":
                        description = helptext = "Compensation factor depending on engine speed used to adjust max allowed m_request depending on ambient air. Resolution is 0.001.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.DivFacHighLoad":
                        description = helptext = "Factor used for calculation of MapPointer when MAF.m_AirInletAir > IgnKnk.AdpHighLim for the time BstKnkCal.DivFacDelTimer. Resolution is 0.03.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.DivFacLowLoad":
                        description = helptext = "Factor used for calculation of MapPointer when MAF.m_AirInletAir < IgnKnk.AdpHighLim . Resolution is 0.03.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.DivFacDelTimer":
                        description = helptext = "Delay time before using the BstKnkCal.DivFacHighLoad. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.OffsetXSP":
                        description = helptext = "Support points for ignition offset. Resolution is 0.1 degree ignition retard.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.n_EngYSP":
                        description = helptext = "Support points for engine speed. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.MaxAirmass":
                        description = helptext = "Map for max allowed airmass for manual gearbox, m_nHigh. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.MaxAirmassAu":
                        description = helptext = "Map for max allowed airmass for automatic gearbox, m_nHigh. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BstKnkCal.NegStep":
                        description = helptext = "If value from matrix (BstKnkCal.MaxAirmass) are belove actual max airmass are actual max airmass decreased with this value. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCo.ST_ACStartAir":
                        description = helptext = "Status bit indicating that Load Compensation function request extra airmass to compensate for AC compressor start load. \"ON\" - Extra air is requested \"--\" - No extra compensation air ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCo.ST_ACCompAir":
                        description = helptext = "Status bit indicating that Load Compensation function request airmass to compensate for AC compressor load. \"ON\" - Comp Air is requested \"--\" - No compensation air ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCo.ST_IdleAdapt":
                        description = helptext = "If compensation airmass for servo pressure are to high are normal idle control adaption disabled. 0 = Adaption allowed. 1 = Adaption not allowed.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCo.Q_TotCompAir":
                        description = helptext = "Total compensation air, electrical- + AC- coldfriction-loadcompensation air. (LoadCoProt.Q_ACAirReq + LoadCoProt.Q_ElLoadCoAir + LoadCo.Q_ColdFricAir). Note, this airflow variable does not include the airmass for throttle potentiometer wiperclean function, LoadCoProt.m_WCleanAir. The total airmass from the loadcompensation function (m_nLow) is: LoadCo.Q_TotCompAir converted to airmass (m) + LoadCoProt.m_WCleanAir. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCo.n_NomIdleOff":
                        description = helptext = "Offset to nominal engine speed depending on servo pressure. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCo.Q_ColdFricAir":
                        description = helptext = "Airmass compensating for cold friction. Resolution is  0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.ST_ACReq":
                        description = helptext = "This is normaly a copy of In.ST_ACReq, but if the driver has pushed the pedal more than a calibrated limit and the engine speed is lower than a calibrated limit, the AC will be turned off by setting LoadCoProt.ST_Req to 0.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.ST_ACRamping":
                        description = helptext = "Status; AC compensating airmass is ramping on or off.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.ST_ElLoadRamp":
                        description = helptext = "Status showing if electrical load compensating airmass is ramping.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.ST_ACExAirDem":
                        description = helptext = "0 = Statusvariable is not initialized or no demand for extra air. 1 = Extra air needed at first AC start due to low temperature. 2 = Extra air is already used.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.t_ElLoadRamp":
                        description = helptext = "Rampingtime. When a change in electrical load occure, the compensation airmass will be increased or decreased during time. Read from a small table using enginespeed as support points.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.Q_ElLoadCoAir":
                        description = helptext = "Airmass compensating for load on engine due to electric consumption.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.Q_ACCompAir":
                        description = helptext = "Airmass compensating for load on engine due to AC-compressor power consumption without extra air due to ACstarttorque.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.Q_ACAirReq":
                        description = helptext = "Airmass compensating for load on engine due to AC-compressor power consumption.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.Q_DynamicAir":
                        description = helptext = "Airmass compensating for extra load on engine due to AC-compressor start up power consumption.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.m_WCleanAir":
                        description = helptext = "Additional airmass from WiperCleaner function. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.t_ACOnOff":
                        description = helptext = "Time when CMD_ACRelay will be turned on or off.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.m_TotCompAir":
                        description = helptext = "Total compensation airmass from loadcompensation function that is send to airmass master: m_nLow = LoadCo.Q_TotCompAir converted to airmass(m) + LoadCoProt.m_WCleanAir. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoProt.ST_ACCrankDone":
                        description = helptext = "This flag will be set to 1 when the AC activation during engine crank is finsihed and normal AC-control is active.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngACShtHigh":
                        description = helptext = "Engine speed limit. Above this engine speed the AC will be turned on, if the shut off function has been active. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngACShtLow":
                        description = helptext = "Engine speed limit. If the engine speed is below this limit when the driver pushes the Acc.Pedal above a calibrated limit, the AC shut off function will be active. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.X_AccPACShtOff":
                        description = helptext = "Accelerator pedal limit. If the engine speed is below a calibrated limit when the driver pushes the Acc.Pedal above this limit, the AC shut off function will be active. The function will be stopped when the driver is releasing the pedal below this limit minus 10% or if the engine speed becomes higher than the LoadCoCal.n_EngACShtHigh limit or if the max time has expired. Resolution is 0.1%.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_ACShutOff":
                        description = helptext = "Max time to keep the AC shut off function active. The function will also be stopped when the driver is releasing the pedal 10% below a calibrated limit or if the engine speed becomes higher than the LoadCoCal.n_EngACShtHigh limit. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_ElLoadDelay":
                        description = helptext = "Delay time before elloadcompesation air starts to ramp up or down after a change in alternator load. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngSP":
                        description = helptext = "Engine speed supportpoints for ElLoad compensation ramping time. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_ElLoadRampTab":
                        description = helptext = "ElLoad compensation ramping time table. The load from the alternator is ramped. The ramping time is engine speed dependent. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.p_ACSP":
                        description = helptext = "Supportpoints for AC-pressure in AC compensation airmassMap and Dynamic (AC startup) comp airmass table. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngineSP":
                        description = helptext = "Engine speed supportpoints for AC compensation airmassMap, delaytime AC-on and delaytime AC-off tables. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_ACCompAirMap":
                        description = helptext = "Airmassflow matrix for AC compensation Air. Resolution is   0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_ACExDynAir":
                        description = helptext = "Airflow compensating extra power- consumption at first AC-start. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_ACRamp":
                        description = helptext = "Time to ramp aircompensation due to extra power consumption AC-startup. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_ACOnDlyTab":
                        description = helptext = "Delay time before AC-startup after AC-request to prepare for extra air. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_ACOffDlyTab":
                        description = helptext = "Delay time before AC-stop after ACOff-request to be able to takeaway compensation air. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.I_LoadSP":
                        description = helptext = "Alternator current supportpoints in electric load compensation table. Resolution is 1 A.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_ElLoadCoTab":
                        description = helptext = "Airflow table for compensation due to alternator power consumption. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.ST_Loop":
                        description = helptext = "Load compensation airmass loop control variable. \"0\" - Limit will not be considered. \"1\" - Open loop. \"2\" - Close loop.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.T_ACExDynAir":
                        description = helptext = "At starts under this engine water temperature extra dynamic air will compensate for extra powerconsumption at the first AC-start. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.v_VehSer":
                        description = helptext = "Vehicle speed limit for steering pressure compensation. Resolution is 0.1 km/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_SerStep":
                        description = helptext = "Time between each step of ramp for servo steering pressure compensation. Resolution is 1 msec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_NomIdleSP":
                        description = helptext = "Support points for higher idle speed due to servo pressure. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_NomIdleTab":
                        description = helptext = "Table for higher idle speed due to servo pressure. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_LimIdleAdap":
                        description = helptext = "If airmass compensating due to steering pressure are above this limit are adaption of normal idle control disabled. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.T_SerIdleSpd":
                        description = helptext = "Idle speed compensating due to steering pressure are not allowed belove this limit. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.ST_PowerSteer":
                        description = helptext = "Enable or disable power steering compensation.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_EngXSP":
                        description = helptext = "Engine speed support points used in cold friction compensation matrix. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.T_EngYSP":
                        description = helptext = "Engine temperature support points used in cold friction compensation matrix. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_ColdFricMap":
                        description = helptext = "Cold friction compensation matrix. Temperature and engine speed depending compensation. Resolution is 1 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.Q_ACDynamicMap":
                        description = helptext = "Dynamic airmass for compensation due to extra power consumption AC-startup. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_CombACCrank":
                        description = helptext = "At engine start is it possible to avoid high AC compressor pressure by activating the AC-compressor during cranking. If In.T_Engine is between -5 and +50 °C and this data not is zero will the AC-relay be activated directly at CPU-powerup and turned off when number of combustions (number of TCD to TDC movements) have reach this limit (ECMStat.n_Combustion >= LoadCoCal.n_CombACCrank) or if engine speed is greater than 350 rpm. (In.n_Engine > 350)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.m_WCleanAir":
                        description = helptext = "Calibrated additional airmass for WiperCleaner function. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.t_WCleanTimer":
                        description = helptext = "Calibrated toggle-time for WiperCleaner function. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.m_WCleanMinLd":
                        description = helptext = "Calibrated minimum load for WiperCleaner function to be able to get activated. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "LoadCoCal.n_WCleanMinRpm":
                        description = helptext = "Calibrated minimum engine speed for WiperCleaner function to be able to get activated. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ST_NegTrans":
                        description = helptext = "Flag showing if it is a negative transient, inlet manifold pressure is decreasing. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ST_PosTrans":
                        description = helptext = "Flag showing if it is a positive transient, inlet manifold pressure is increasing. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ST_NegFuelTrans":
                        description = helptext = "Flag showing if it is a negative transient for freezing of weight factor. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ST_PosFuelTrans":
                        description = helptext = "Flag showing if it is a positive transient for freezing of weight factor. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ST_Transient":
                        description = helptext = "Flag showing if it is a rpm transient. If 3 readings in a row is bigger (or smaller) than previous reading, then this flag is set. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.LoadPointer":
                        description = helptext = "Load pointer in redundant airmassflow Map. LoadPointer = In.p_AirInlet * ConstT_Engine * ConstT_AirInlet. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ConstT_Engine":
                        description = helptext = "Constant compensating for cooling water temp in Load calculation for redundant airmass flow function. LoadPointer = In.p_AirInlet * ConstT_Engine * ConstT_AirInlet. Resolution is 0.01.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.ConstT_AirInlet":
                        description = helptext = "Constant compensating for inlet air temp in Load calculation for redundant airmass flow function. LoadPointer = In.p_AirInlet * ConstT_Engine * ConstT_AirInlet. Resolution is 0.01.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.X_DecreaseStep":
                        description = helptext = "Number of readings in a row where t_tdc_tdc has decreased. Used for defining transients. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.X_IncreaseStep":
                        description = helptext = "Number of readings in a row where t_tdc_tdc has increased. Used for defining transients. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.t_NegTransFreez":
                        description = helptext = "Time to keep negative transient flag set after MAFProt.p_DeltaInlet is in Steady state level again. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.t_PosTransFreez":
                        description = helptext = "Time to keep positive transient flag set after MAFProt.p_DeltaInlet is in Steady state level again. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.HFMWeightCoef":
                        description = helptext = "Actual filter constant for Fuel airmass filter. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.p_DeltaInlet":
                        description = helptext = "Actual pressure gradient in inlet manifold used for airmass filtering. Resolution is 1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.t_TDC_TDC_Filt":
                        description = helptext = "Filtered time in TPU timerticks for calculation of load signal. The unfiltered value is \"ActualIn.t_TDC_TDC\".";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.Q_AltitudeComp":
                        description = helptext = "Altitude compensation that is added onto MAF.Q_AirFromArea.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFProt.AltCompPercent":
                        description = helptext = "Altitude compensation in percent that is added onto MAF.Q_AirFromArea. See also MAFProt.Q_AltitudeComp.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.Q_AirInletFilt":
                        description = helptext = "Inlet manifold air flow from maf sensor in gram per second filtrated. This air flow is recalculated from MAF.m_AirInletAir. Resolution is 0.01 g/s. Interval is every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInlet":
                        description = helptext = "Airmass in milligram per combustion. This airmass is the actual load value in the ECM. (Unfiltered) Calculated from ActualIn.Q_AirInlet. Resolution is 1 mg/c. Interval is every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletBoost":
                        description = helptext = "Airmass in milligram per combustion. Filtered, used for boost control. Resolution is 1 mg/c. Interval is every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletFuel":
                        description = helptext = "Airmass in milligram per combustion. Filtered, used for fuel calculation. Resolution is 1 mg/c. Interval is every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletIgn":
                        description = helptext = "Airmass in milligram per combustion. Filtered, used for ignition calculation. Resolution is 1 mg/c. Interval is every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletAir":
                        description = helptext = "Airmass in milligram per combustion. Filtered, used for Air control functions. Resolution is 1 mg/c. Interval is 10ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirInletTorq":
                        description = helptext = "Filtrated airmass variable copying MAF .m_AirFromp_AirInlet in positive transients, MAF.m_AirInletAir during negative transients and Steady state. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.m_AirFromp_AirInlet":
                        description = helptext = "Redundant calculated airmassflow. Read from p_AirInlet sensor compensated for inlet air temperature and cooling water temperature. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.Q_AirFromp_AirInlet":
                        description = helptext = "Redundant calculated airmassflow. Converted from m_AirFromp_AirInlet. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.Q_AirFromArea":
                        description = helptext = "Airflow calculated from throttle area. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAF.p_InlBefQuote":
                        description = helptext = "This variable is (p_AirInlet / p_AirBefThrottle) * 100. It is used in calculation of air flow from area.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.X_DecrStepLim":
                        description = helptext = "Number of decreasing readings of t_tdc_tdc in a row to define a positive engine speed transient. Used for shoosing rpm filter type for Q to m conv. Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.X_IncrStepLim":
                        description = helptext = "Number of increasing readings of t_tdc_tdc in a row to define a negative engine speed transient. Used for shoosing rpm filter type for Q to m conv. Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.WeightCoefFConst":
                        description = helptext = "HFM - p_AirInlet weight coefficient filter constant. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAFProt.HFMWeightCoef old_value -> old MAFProt.HFMWeightCoef new_value -> reading from map Const -> MAFCal.WeightCoefFConst If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterCFuelSteady":
                        description = helptext = "Airmass filter constant for Fuel calculation Steady state. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> local variabel used for MAF.m_AirInletFuel old_value -> old local variabel new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCFuelSteady If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.). Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterCFuelTrans":
                        description = helptext = "Airmass filter constant for Fuel calculation during transient. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> local variabel used for MAF.m_AirInletFuel old_value -> old local variabel new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCFuelTrans If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterCIgnSteady":
                        description = helptext = "Airmass filter constant for Ign. calc. at Steady state and negative transients. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletIgn old_value -> old MAF.m_AirInletIgn new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCIgnSteady If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterCIgnTrans":
                        description = helptext = "Airmass filter constant for Ign. calc. at positive trans. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletIgn old_value -> old MAF.m_AirInletIgn new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCIgnTrans If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterCTorqSteady":
                        description = helptext = "Airmass filter constant for Torq. calc. at Steady state and positive transients. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletTorq old_value -> old MAF.m_AirInletTorq new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCTorqSteady If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterCTorqTrans":
                        description = helptext = "Airmass filter constant for Torq. calc. at negative trans. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletTorq old_value -> old MAF.m_AirInletTorq new_value -> MAF.m_AirInlet Const -> MAFCal.FilterCTorqTrans If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterConstAir":
                        description = helptext = "Airmass filter constant for airmass control. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletAir old_value -> old MAF.m_AirInletAir new_value -> MAF.m_AirInlet Const -> MAFCal.FilterConstAir If Const = 1 to 8, effective filter is used (shift. istead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new (800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.FilterConstBoost":
                        description = helptext = "Airmass filter constant for Boost function. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value -> MAF.m_AirInletBoost old_value -> old MAF.m_AirInletBoost new_value -> MAF.m_AirInlet Const -> MAFCal.FilterConstBoost If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.t_FreezeNegTrans":
                        description = helptext = "Time to keep negative transient flags set while the HFM-signal makes big under shot. If this constant is 0, then no negative transients will be trigged. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.t_FreezePosTrans":
                        description = helptext = "Time to keep positive transient flags set while the HFM-signal makes big over shot. If this constant is 0, then no positive transients will be trigged. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.p_DeltaTransLim":
                        description = helptext = "Pressure delta limit constant. A absolute p_Delta value above this limit will set the negative or positive transient flag for calculation of engine load for ignition and torque functions. The flag is then kept for a calibrated time. It is used for copying m_AirInletFrompInlet to MAF.m_AirInletIgn during negative transients and for copying m_AirInletFrompInlet to MAF.m_AirInletTorq during positve transients. Steady-state both these are filtered HFM-signals. When switching between m_AirInletFrompInlet and HFM-signal, a simpel adaption is used to have smooth transitions. Resolution is 1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.p_DeltaFuelTrans":
                        description = helptext = "Pressure delta limit constant. A absolute p_Delta value above this limit will set the negative or positive fuel transient flag. The flag is then kept for a calibrated time. This makes it possible to calculate MAF.m_AirInletFuel from inlet pressure even if p_Delta is close to 0, while the HFM reading has a big deviation compared to what the inlet pressure indicates. Resolution is 1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.n_EngineXSP":
                        description = helptext = "Engine speed support points for weight coefficient matrix for calculation of MAF.m_AirInletFuel. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.p_InletGradYSP":
                        description = helptext = "Inlet manifold pressure gradient support points for weight coefficient matrix for calculation of MAF.m_AirInletFuel. Resolution is 1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.t_NegTransFreezTab":
                        description = helptext = "Time to keep negative fuel transient flag set while the HFM-signal makes big under shot. If a reading from this table is 0, then no negative fuel transient will be trigged. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.t_PosTransFreezTab":
                        description = helptext = "Time to keep positive fuel transient flag set while the HFM-signal makes big over shot. If a reading from this table is 0, then no positive fuel transient will be trigged. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.WeightConstFuelMap":
                        description = helptext = "Matrix including weighting constant for weighting airflow read from HFM (filtrated) and airflow calculated from inlet manifold pressure to calculate MAF.m_AirInletFuel. Formula: 100 * ( HFM_value - Press_value ) +/- Const Filt_value = Press_value + Const if Press_value > HFM_value -> - Const if Press_value <= HFM_value -> + Const Filt_value -> MAF.m_AirInletFuel HFM_value -> Filtrated local m_AirInlet Press_value -> MAFProt.m_LoadpAirInlet Const -> MAFProt.HFMWeightCoef (100 = 100% new, 200 = 50% new, 400 = 25% new) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.X_RpmFiltConst":
                        description = helptext = "Filter constant for engine speed calculation for converting between Q and m. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + Const if old_value > new_value -> - Const if old_value <= new_value -> + Const (100 = 100% new, 200 = 50% new, 400 = 25% new) . Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.T_EngineSP":
                        description = helptext = "Engine cooling water temp support points for consttable . Resolution is 1 deg C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.ConstT_EngineTab":
                        description = helptext = "Engine cooling water temperature Const table for calculation of Load pointer in redundant airmassflow Map. LoadPointer = In.p_AirInlet * ConstT_Engine * ConstT_AirInlet . Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.T_AirInlSP":
                        description = helptext = "Inlet Air temperature support points for consttable. Resolution is 0.1 deg C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.ConstT_AirInlTab":
                        description = helptext = "Inlet manifold air temperature Const table for calculation of Load pointer in redundant airmassflow Map. LoadPointer = In.p_AirInlet * ConstT_Engine * ConstT_AirInlet . Resolution is 0.01.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.n_EngXSP":
                        description = helptext = "Engine speed support points for matrix for redundant m_AirInlet and q_air_from_airinlet, calculated from inlet manifold pressure. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.LoadYSP":
                        description = helptext = "Engine load support points calculated from inlet manifold pressure and temperature influence. For q_air_from_airinlet calculation the support point is calculated from in.p_airinlet only. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.m_RedundantAirMap":
                        description = helptext = "Redundant m_AirInlet Map. Interpolated from engine speed and engine load support points. Engine load is calculated from inlet manifold pressure and adjusted depending on engine temperature and inlet air temperature. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.AreaXSP":
                        description = helptext = "Throttle area support points to get Cd-value from cd_ThrottleMap. Resolution is 1 mm°.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.PQuoteYSP":
                        description = helptext = "Pressure quote (before/after throttle) support points to get Cd-value from cd_ThrottleMap. Resolution is 0.01 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.cd_ThrottleMap":
                        description = helptext = "Air flow coefficient (Cd-value) used in calculation of air flow from throttle area. This value is shifted 10 positions to the left (i.e. multiplied with 1024).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.PDiffSP":
                        description = helptext = "Pressure difference support points for p_DiffCoeffTab.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.p_DiffCoeffTab":
                        description = helptext = "Coefficient for Px/P0 (where Px = inlet pressure and P0 is pressure before throttle) used in calculation of air flow from throttle area. This value is shifted 10 positions to the left (i.e. multiplied with 1024) AND multiplied with 10. The reason for the last multiplication is to get a. Resolution of 0.01 g in the calculated air flow.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.TCompSP":
                        description = helptext = "Temperature support points for p_DiffCoeffTab.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.T_TempCoeffTab":
                        description = helptext = "Coefficient for temperature factor in calculation of air flow from throttle area. This factor is: sqrt(R*T0), where R=287 and T0 is temperature before throttle in Kelvin.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.Diagn_EngXSP":
                        description = helptext = "Engine speed support points for matrix for corr_AirFromp. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.DiagLoadYSP":
                        description = helptext = "Engine load support points calculated from inlet manifold pressure. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.cd_Level":
                        description = helptext = "Is used to set the pressure level while cd_mapping for calculation of MAF.Q_AirfromArea not depending on altitude.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MAFCal.AltitudeMulFac":
                        description = helptext = "Is used to set the mul factor for calculation of MAF.Q_AirfromArea not depending on altitude.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MapChk.ST_Error":
                        description = helptext = "Status bit indicating that the checksum calculated on the calibration data which can increase airmass demand is faulty or not. 0 = checksum OK or not checked. 1 = checksum faulty (memory error or hardware problem) ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MapChk.CheckSum":
                        description = helptext = "Checksum calculated in background from the data which can increase airmass demand.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MapChkCal.ST_Enable":
                        description = helptext = "Status constant indicating if checksum is calculated on the calibration data which can increase airmass demand. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MapChkCal.CheckSum":
                        description = helptext = "Checksum calculated from the calibration data file, which can increase airmass demand.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdProt.n_EngLimAir":
                        description = helptext = "Actual engine speed limit for reducing the amount of air when a gear is selected. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpd.n_EngLimFuel":
                        description = helptext = "Engine speed limit for fuelcut, this limit is always active undepending of detected gear. This limit is 200rpm above \"MaxSpdProt.n_EngLimAir\". Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpd.AirOffset":
                        description = helptext = "Offset for decrease of airmass request depending on high engine speed. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.T_EngineSP":
                        description = helptext = "Temperature suportpoints for table including max engine speed. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.n_EngLimAir":
                        description = helptext = "This table include the maximum engine speed limit. Above this limit will the airmass be reduced if a gear is detected. It is always fuelcut above this limit + 200rpm. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.AirOffset":
                        description = helptext = "Factor for decrease requested airmass when engine speed are to high. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.RampFac":
                        description = helptext = "Factor for decrease airmass offset when engine speed have been to high. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.MaxOffset1":
                        description = helptext = "Max allowed offset (MaxSpd.AirOffset). Used for gear 1 and 2. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.MaxOffset2":
                        description = helptext = "Max allowed offset (MaxSpd.AirOffset). Used for gear higher than 2. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.n_EngMin":
                        description = helptext = "The airmass offset depending on to high engine speed are cleared belove this engine speed. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "MaxSpdCal.n_FuelCutOffset":
                        description = helptext = "The offset between fuelcut and reducing air only. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLim.ST_FCutAllowed":
                        description = helptext = "Status bit enabling fuel cut from AirMinLim Master when Tipout is ready. \"ON\" - Fuel Cut allowed \"--\" - Fuel Cut not allowed";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLim.ST_MinLimAct":
                        description = helptext = "Status variable indicating which MinLim is active (highest) for the moment. 0 = Min Load highest 1 = Tipout highest 2 = LDA function highest";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLim.m_LDAReq":
                        description = helptext = "From Torque Master requested min airmass for LDA function. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimProt.Q_MinLoad":
                        description = helptext = "The lowest airmass the engine needs at the actual engine speed. Resolution is  0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimCal.ST_Loop":
                        description = helptext = "Engine Airmassflow Min Limit regulating loop control variable. \"0\" - Limit will not be considered. \"1\" - Open loop. \"2\" - Close loop.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimCal.Q_MinLoadTab":
                        description = helptext = "Minimum airmass flow for the engine. Below this limit the HC-emission will increase rapidly, due to bad combustion. Resolution is 0.01 g/s.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimCal.n_EngineSP":
                        description = helptext = "Engine speed supportpoints for Q_MinLoad table. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AirMinLimCal.n_EngYSP":
                        description = helptext = "This dummy variable is needed when linking executable programs with link332.bat batch fil. Switchpoint calculations is using this data.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
