                        break;
                    case "SwitchCal.PedDebouncing":
                        description = helptext = "Debouncing time to detect that the pedal status indicates idle. Resolution is 10 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_OffsetPoti2":
                        description = helptext = "Offset to detect throttle poti2 in idle. If relative throttlepoti2 > a_switchpoint + hysteresis non idle is indicated. The a_switchpoint for poti2 is calculated in the same way as for poti1.The only exception is that an offset is added to compensate the non linearity error of the two potis. That means throttle poti2 always indicates idle on a higher level than poti1. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_SwitchErrHyst":
                        description = helptext = "Hysteresis used to detect if throttle is in idle position. If throttle_area > switchpoint_area + hysteresis_area, not in idle position is indicated. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_Tolerance":
                        description = helptext = "Offset used for calculation of the limited throttle area. Limited throttle_area = switchpoint_area - tolerance_area. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_ACOffset":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint if ac is active. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_DPOffset":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint if dashpot dummy varible is active. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_LDAOffset":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint if LDA is active. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.n_EngStartOff":
                        description = helptext = "Safety switch must limit the time when start offset .. The SwitchCal.A_StartOffset is added to the map SwitchCal.A_SwitchPoint as long as: - the start is active (Idle.StartAirMode > 0) and - the time since engine speed went above SwitchCal.n_EngStartOff is less than SwitchCal.t_EngStartOff. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.t_EngStartOff":
                        description = helptext = "Safety switch must limit the time when start offset .. The SwitchCal.A_StartOffset is added to the map SwitchCal.A_SwitchPoint as long as: - the start is active (Idle.StartAirMode > 0) and - the time since engine speed reached SwitchCal.n_EngStartOff is less than SwitchCal.t_EngStartOff. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_StartOffset":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint if start is active. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_LOffOffset":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint if ?? is active. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_ACStartOffs":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint during AC start up. Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.p_AmbientYSP":
                        description = helptext = "Ambient air pressure support points for ambient air pressure compensation offset matrix in the switch point function. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.n_EngXSP":
                        description = helptext = "Engine support points for ambient air pressure compensation offset matrix in the switch point function. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_AmbPresMap":
                        description = helptext = "Offset to the map SwitchCal.A_SwitchPoint to compensate for high altitude. (Low ambient air pressure). Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.T_Engine":
                        description = helptext = "T_Engine support point for map A_switchpoint = f(T_Engine,n_Engine). Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.n_Engine":
                        description = helptext = "n_Engine support point for map A_switchpoint = f(T_Engine,n_Engine). Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SwitchCal.A_SwitchPoint":
                        description = helptext = "A_SwitchPoint = f(T_Engine,n_Engine). Resolution is 1 mm^2.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TempTiCal.x_axis":
                        description = helptext = "values for x-axis Gradient of p_Airinlet measured every 50 ms. Input parameter for the table TempTiCal. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TempTiCal.y_axis":
                        description = helptext = "Airmass deviation values for y-axis Input parameter for the table TempTiCal. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TempTiCal.map":
                        description = helptext = "Parameter for I-part of airmass-controller Changes the behavior of the controller. shorter time => quicker the I-part of the controller. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TempTiIdleCal.Idle":
                        description = helptext = "Parameter for I-part of airmass-controller Changes the behavior of the controller. shorter time => quicker the I-part of the controller. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TiCalcuCal.ms_InletUpdate":
                        description = helptext = "Update time of delta p_Inlet. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TiCalcuCal.TiNoPressure":
                        description = helptext = "Used ti parameter if pressure over throttle is in a certain range. Resolution is 1 bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TiCalcuCal.p_DiffMin":
                        description = helptext = "Determind the minimum pressure over throttle where a manipulation of the ti parameter is allowed. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TiCalcuCal.p_DiffHysteresis":
                        description = helptext = "Determind the hysteresis of pressure over throttle where a manipulation of the ti parameter is allowed if pressure > p_DiffMin the I-part will be frozen if pressure < p_DiffMin - Hysteresis then ti is taken out of ti map. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TempLimPosCal.Airmass":
                        description = helptext = "values for x-axis Specifies the table TempLimPosCal.table";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TempLimPosCal.Limit":
                        description = helptext = "Positive limit the I-part for the addional id-controller limit = f (airmass). Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.ST_FuelCutReq":
                        description = helptext = "Status variable showing if Torque Master requests Fuel Cut Off. The FCO request will come if M_Engine > torque limit + calibrated offset. 0 = Fuel Cut Off not requested 1 = Fuel Cut Off requested ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.ST_ExtTrqLim":
                        description = helptext = "Ignition influence on torque read from matrix. 0 = Extern Limit Req will be made by air reduction 1 = short time, reduction will only be done by ignition 2 = longer time, reduction by air just for a while 3 = Overtime, Request has durated more than In.t_ExtLimDuration + TorqueCal.t_ThrOverTime";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.M_MaxEngAndGear":
                        description = helptext = "Maximum engine and gearbox torque at the actual engine speed. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.ST_NoiseReduc":
                        description = helptext = "Status showing which mode is actual for the noise reduction function. 0 = No reduction. 1 = Reduction is trigged but not activated. 2 = Reduction is requested at calibrated level. 3 = Reduction is requested and ramping.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.M_Nominal":
                        description = helptext = "Nominal engine output torque at a certain enginespeed and inlet airmass. Read from matrix.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "Torque.fi_IgnLim":
                        description = helptext = "Ignition angle limit, where earlier spark will reduce the torque, read from matrix.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.fi_IgnReq":
                        description = helptext = "Ignition angle request to Ignition Master to reduce the torque.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.fi_IgnMin":
                        description = helptext = "Min ignition angle request to Ignition Master to reduce the torque. Interpolated from temperature depended table.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.m_Friction":
                        description = helptext = "Airmass corresponding to the torque losses due to extra friction because the engine is not warm and also corresponding diffrence between the actual engine and the engine used when calibration of torqueMap was done. Used for compensation when calculating and limiting engine output torque.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_NoiseReduc":
                        description = helptext = "Max engine output torque to keep vehicle noise at a approved limit when accelerating from 50 km/h (or calibrated speed).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_LowLim":
                        description = helptext = "By the Torque Master selected lowest torque limit request, corrected with adaption value made at idle.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_LimForIgnRed":
                        description = helptext = "Torque limit request for ignition reduction.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.m_AirTMasLim":
                        description = helptext = "The Torque Masters requested airmass to limit engine output torque. Resolution is   1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_AccumIgnRed":
                        description = helptext = "Accumulated ignition reduction time. Added when reduction is active and subtracted when no ignition is active. Subtraction can be reduced by a calibrated factor. Resolution is   1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_NoiseRedTrig":
                        description = helptext = "When msCounter reaches this time, the noise reduction limitation will be trigged if the driver pushes the accpedal above the calibrated level. Resolution is  1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_NoiseRedConst":
                        description = helptext = "When msCounter reaches this time, the noise reduction limitation has been trigged and reduced the torque at the calibrated limit for the calibrated time. The ramp will now start. Resolution is  1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_NoiseRedRamp":
                        description = helptext = "When msCounter reaches this time, the noise reduction limitation has been trigged and reduced the torque at the calibrated limit for the calibrated time and the ramp is also finished. Resolution is  1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ms_ShUp":
                        description = helptext = "Last system time TCM made a shift up. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ms_ShDown":
                        description = helptext = "Last system time TCM made a shift down. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_OutAccPed":
                        description = helptext = "Calculated accelerator pedal position. : The same value as Out.X_AccPedal. (Help varaible). Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_OutAccPed1":
                        description = helptext = "Calculated accelerator pedal position. WITHOUT affect from: - Limitation of Out.X_AccPedal delta - Out.X_AccPedal offset Used when you want to see the affect of Out.X_AccPedal delta limitation and offset. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_OutAccPed2":
                        description = helptext = "Calculated accelerator pedal position. WITHOUT affect from: - Out.X_AccPedal offset Used when you want to see the affect of Out.X_AccPedal offset. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_OOutAccPed":
                        description = helptext = "Calculated accelerator pedal position. The value of Out.X_AccPedal 10 ms ago. Used for limitation of delta. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_Offset":
                        description = helptext = "Out.X_AccPedal offset (included in the Out.X_AccPedal) The offset result of the gear shift support function. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.nosample":
                        description = helptext = "Counter for internal use";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.n_engbuf":
                        description = helptext = "Stored old values of In.n_Engine10ms to be used as pointer in convertion of torquemaster to m_Air AND max engine torque";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.n_engfilt":
                        description = helptext = "Filtered value of In.n_Engine10ms to be used as pointer in convertion of torquemaster to m_Air AND max engine torque";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_gearShift":
                        description = helptext = "Time when filtering started";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_OverBoostTimer":
                        description = helptext = "Shows how long the overboostfunction has been enabled";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.t_CoolingTimer":
                        description = helptext = "Shows how long the m_Request has been below the calibration value.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_LowInternal":
                        description = helptext = "Torque maximum of internal engine functions, used for calculating Out.M_DTI";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_Rotation":
                        description = helptext = "Torque needed for engine to change rotationenergy";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_Total":
                        description = helptext = "Actual torque from engine, where all three components are added, actual air, ignition and moment of inertia. M_Total = TorqueProt.M_Rotation + Torque.M_Nominal - M_OffsetIgn";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.a_FreeRolling":
                        description = helptext = "Rolling resistance (measured in acceleration) for the vehicle in current speed";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_EngineByAcc":
                        description = helptext = "Engine torque measured by acceleration of vehicle";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_OffsetIgn":
                        description = helptext = "Differance between Torque.M_Nominal and Out.M_Engine";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_OffAirEng":
                        description = helptext = "Differance between Torque.M_Nominal and Out.M_Engine due to Igntemperaturefi_Offset";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_TorqMastAct":
                        description = helptext = "Status showing which function is limiting torque in Torque Master. M = Manual gear box limitation. A = TCM limit request (Extern limit from bus). S = Automatic gearbox Stall limit request. T = TCS (traction control) limit request. E = Max Engine Torque limitation. R = Reverse limit request. N = Noise reduction limit request. D = Misfire diagnose limit request B = Brake limit request P = Diff Protection System limit request";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_LimWheelAct":
                        description = helptext = "Status showing which function is reducing airmass in Limit Wheel Master. V = Max Vehicle speed limit request. T = Torque Master limit request.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.M_IgnInflTorq":
                        description = helptext = "Ignition influence on torque read from matrix. Resolution is  0.1 Nm/deg.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_NewActGear":
                        description = helptext = "Actual gear. Used for detection of gear shift. New number to make detection of shift up and shift down easier. 2 - Reverse 3 - Neutral 5 - Gear 1 6 - Gear 2 7 - Gear 3 8 - Gear 3, lock up 9 - Gear 4 10 - Gear 4, lock up";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.X_OldActGear":
                        description = helptext = "Actual gear 10 ms ago. Used for detection of gear shift. New number to make detection of shift up and shift down easier. 2 - Reverse 3 - Neutral 5 - Gear 1 6 - Gear 2 7 - Gear 3 8 - Gear 3, lock up 9 - Gear 4 10 - Gear 4, lock up";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_filter_n_Eng":
                        description = helptext = "Indicates if pointer TorqueProt.n_engfilt is filtered or not. 0: filter off, TorqueProt.n_engfilt = In.n_Engine10ms 1: filter on, TorqueProt.n_engfilt = average of In.n_Engine10ms during the last TorqueCal.nosample. (one sample per call of Torquemaster)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.manualgear":
                        description = helptext = "Stored gear since last call of Torquemaster";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.OverBoostMode":
                        description = helptext = "Which mode the overboostfunction is in 0 = No overboost 1 = Overboost 2 = Ramping 3 = Overboost not allowed 4 = Not overboosting 5 = Cooling";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueProt.ST_NoIgnitionRetard":
                        description = helptext = "Status flag of ignitionretardation: 0 = Ignition retardation allowed 1 = Ignition retardation not allowed";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.ST_IgnOffsEnable":
                        description = helptext = "Torque Master Ignition Offset Status. 0 = Ignition Offset Disabled. 1 = Ignition Offset Enabled for all torque functions. 2 = Ignition Offs Enabled for all torque functions except ASR/TCS";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.ST_Loop":
                        description = helptext = "Limit Wheel airmass control loop status variable. \"0\" - Limit will not be considered. \"1\" - Open loop. \"2\" - Close loop.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.X_CoolFactor":
                        description = helptext = "Factor for reducing cooling time when subtracting accumulated ignition reduction time, caused by torque limit function. 0 --> subtracted time = time / 1 1 --> subtracted time = time / 2 2 --> subtracted time = time / 4 3 --> subtracted time = time / 8 4 --> subtracted time = time / 16";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_OffsFCOStart":
                        description = helptext = "Difference between actual engine torque and torque limit calculated by the Torque Master, where Fuel Cut Off will start to be requested. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_OffsFCOStop":
                        description = helptext = "Difference between actual engine torque and torque limit calculated by the Torque Master, where Fuel Cut Off will not be requested. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_HysIgnRedOff":
                        description = helptext = "Difference between actual engine torque and torque limit calculated by the Torque Master, where Ignition reduction will stop to be is used. It is also used as ign. red. start hysteresis when the TCM has a short torque reduction, because the M_HysIgnRedOn is bigger than this data. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_HysIgnRedOn":
                        description = helptext = "Difference between actual engine torque and torque limit calculated by the Torque Master, where Ignition reduction will start to be is used. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_DebFuelCut":
                        description = helptext = "Debouncing time used to wait for M_Engine overshoot to disappear before Fuel Cut Off is reqested when calculated engine torque is higher than torque limit + M_OffsFCutStart. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_MaxIgnReduc":
                        description = helptext = "Maximum time for ignition reduction caused by torque limit function during t_CoolDown time. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_ThrReaction":
                        description = helptext = "Reaction time for throttle moving a step corresponding a torque limitation. Used for deceiding if a air reduction should be made or if just a ignition reduction should be made. If In.t_ExtTorqLimDuration is at least twice t_ThrReaction, then air reduction will be made. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_ThrOverTime":
                        description = helptext = "If In.t_ExtTorqLimDuration + t_ThrOverTime has passed since started and air reduction is not active, air reduction will be made until ExtTorqLim is finished. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_LDA1Lim":
                        description = helptext = "Minimum engine torque limit, when the driver has released the accelerator pedal so much that the front wheels are slipping. Low limit. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_LDA2Lim":
                        description = helptext = "Minimum engine torque limit, when the driver has released the accelerator pedal so much that the front wheels are slipping. High limit. Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_StallLimit":
                        description = helptext = "Maximum engine torque limit, when the driver is pushing both the brakepedal and the accelerator pedal at the same time.(Only cars with auto.gearbox). Resolution is 1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.fi_IgnMinTab":
                        description = helptext = "Minimum allowed absolute ignition timing when reducing torque, depending on engine temperature. Resolution is 0.1 degree.";
