                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_EngMaxTab":
                        description = helptext = "Data-table for maximum engine output torque for manual cars. Resolution is   1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_EngMaxE85Tab":
                        description = helptext = "Data-table for maximum engine output torque for cars running E85. Resolution is   1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_EngMaxAutTab":
                        description = helptext = "Data-table for maximum engine output torque for automatic cars. Resolution is   1 Nm.";
