                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_NoiseRAt50km":
                        description = helptext = "The vehicle speed must be within the calibrated limits during this time, to start a torque reduction to avoid noise after the driver has pressed the acc.pedal to the calibrated level. Resolution is 1 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.t_NoiseRedConst":
