                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.ST_XAccLimRes":
                        description = helptext = "Too high engine torque at gear shift during RESUME Enables the \"Limitation functionality\" in the Gear Shift Support function that: - freeze Out.X_AccPedal a specified time after gear shift and - slow down changes in Out.X_AccPedal,max Out.X_AccPedal delta also during a RESUME (Cruise.ST_ResumeMode == 1). The function is used for preventing unnecessary gear shift but may cause \"Hard\" gear shift. Only used in automatic cars when driving with cruise control and not overriding cruise with accelerator pedal. 0 = Limitation function NOT active during RESUME 1 = Freeze of Out.X_AccPedal after gear shift during RESUME 2 = Limit change of Out.X_AccPedal during RESUME 3 = 1 + 2";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.X_Step":
                        description = helptext = "Max Out.X_AccPedal delta ( % / 10ms ). This to slow down changes in Out.X_AccPedal. Only used in automatic cars when driving with cruise control and not overriding cruise with accelerator pedal. Resolution is   0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.X_MaxOffset":
                        description = helptext = "Max value for Gear shift support offset. Resolution is   0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
