                    case "TorqueCal.t_gearShAct":
                        description = helptext = "Time that filtering should be active. Resolution is  100 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "TorqueCal.M_OverBoostTab":
                        description = helptext = "Max engine torque at overboost. Resolution is   1 Nm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
