                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.I_LoadLim":
                        description = helptext = "Load limit tab. to enable the I Part of boost regulator. If the load request from airmass master is above this value plus the hysteres is the I Part enabled and the throttle closed loop is disabled. If the load request from airmass master is below this value is the I Part disabled and the throttle is alowed to run in closed loop.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
