                        description = helptext = "Calculated D part for regulator. OBS! There might be problems with the OBDII diagnose when using this part. load derivata * D const D = 20. Update : every 10 msec. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.PConst":
                        description = helptext = "P constant for P part calculation of regulator. f(load diff, rpm). Update : every 100 msec";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.IConst":
                        description = helptext = "I constant for I part calculation of regulator. f(load diff, rpm). Update : every 100 msec";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
