                    case "BoostProt.DConst":
                        description = helptext = "D constant for D part calculation of regulator. f(load derivata, rpm). Update : every 100 msec";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
