                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.ActPercent":
                        description = helptext = "Percent regulator constant including adaption divided with PWM actuality are. Update : every 100 msec. Resolution is 1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
