                        description = helptext = "Differance between requested load and I-part limit. BoostProt.LoadRequest - (BoostProt.I_LoadLim + hysteres). Update : Calculated every 100 msec when I part are activated.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.ReqDerivata":
                        description = helptext = "M_Request derivata. Resolution is 1 mg/c. Interval is 20 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "BoostProt.ReqDerivata100ms":
                        description = helptext = "M_Request derivata used in \"to high\" adaption conditions. Resolution is 1 mg/c. Interval is 100 ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
