                    case "obdEvap.ST_ColdStart:1":
                        description = helptext = "If temperature is regared as cold start this flag is set. If temperaturegoes out of limits then it's clered. Cold start definition :if ((Environ.engineStartTemp() > EvapDiagCal.T_LoLim) &&(Environ.engineStartTemp() < EvapDiagCal.T_HiLim) &&(Environ.inletAirStartTemp() > EvapDiagCal.T_LoLim) &&(Environ.inletAirStartTemp() < EvapDiagCal.T_HiLim) &&(Environ.inletAirStartTemp() < (Environ.engineStartTemp() + EvapDiagCal.T_Diff)) &&(Environ.inletAirStartTemp() > (Environ.engineStartTemp() - EvapDiagCal.T_Diff)) &&evapHasBeenOutOfLim == false). Resolution is 1. Interval is background.";
                        category = XDFCategories.Undocumented;
