                    case "obdEvap.LeakageFactor":
                        description = helptext = "Shows what kind of leakage 0 = ignition off 10 = No leak, test 1 11 = 0,5 leak test 1 12 = 1,0 leak test 1 13 = Filtered test, too big diff 20 = No leak, test 2 22 = 1,0 leak test 2 23 = Filtered test, too big diff 1011 = big leak in ramp 1 level 1 test 1 1012 = big leak in ramp 1 level 2 test 1 1013 = big leak in ramp 1 level 3 test 1 1021 = big leak in ramp 1 level 1 test 2 1022 = big leak in ramp 1 level 2 test 2 1023 = big leak in ramp 1 level 3 test 2 1031 = big leak in ramp 1 level 1 test 3 1032 = big leak in ramp 1 level 2 test 3 1033 = big leak in ramp 1 level 3 test 3. Resolution is 1. Interval is background.";
