                    case "obdEvap.BreakPreCondition":
                        description = helptext = "1 = obdEvap.ST_NeedForSpeed 2 = In.v_Vehicle < pEvapTestCal->v_loLim || In.v_Vehicle > pEvapTestCal->v_hiLim 3 = obdFuelLevel.V_FuelTankFilt <= EvapDiagCal.V_FuelMin 4 = obdFuelLevel.V_FuelTankFilt > EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank 6 = obdEvap.p_FuelTankFilt > EvapDiagCal.MaxTankPressure 8 = obdEvap.n_BrakeChanges > pEvapTestCal->nrOfBrakeChangeLim 9 = Purge.Status != 0 10 = obdEvap.ST_ColdStart == false && purgeFirstStartRampOK == false) 11 = (In.U_Batt <= 100) || (In.U_Batt >= 160) 12 = ECMStat.p_Diff >= -200 13 = Purge.AdaptionEvap < pEvapTestCal->PurgeloLim || Purge.AdaptionEvap > pEvapTestCal->PurgehiLim 14 = MAF.m_AirInlet < EvapDiagCal.m_loLim) || MAF.m_AirInlet > EvapDiagCal.m_hiLim) 15 = obdEvap.ST_WaitAfterBreak 17 = FCut.ST_FuelCut = true 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->pAirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This willstop active test for rest of the DCY 20 = vVehicle.hasReportedFault() == true 21 = Out_CMD_Purge.hasReportedFault() == true 22 = Out_PW_Purge.hasReportedFault() == true 23 = BrakeLight.hasReportedFault() == true 24 = tEngine.hasReportedFault() == true 25 = tAirInlet.hasReportedFault() == true 26 = ECMStat.ST_TCSCANBased == true && In_TCS.hasReportedFault == true 27 = obdEvap.ST_FillerCapTestDone == true && obdEvap.ActiveTest == TEST3_FILLERCAP 28 = The start was not a powerup, obdpTankAdap.ST_FirstTimeAfterPowerUp 30 = environment temp to low. Resolution is 1. Interval is background.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "obdEvap.BreakCondDurTest":
                        description = helptext = "2 = In.v_Vehicle < (obdEvap.v_VehicleSpeedPrecondition - pEvapTestCal->v_Diff) In.v_Vehicle > (obdEvap.v_VehicleSpeedPrecondition + pEvapTestCal->v_Diff) 3 = obdFuelLevel.V_FuelTankFilt <= EvapDiagCal.V_FuelMin 4 = obdFuelLevel.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.MaxTankPressure 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->nrOfBrakeChangeLim 11 = (In.U_Batt <= 100) || (In.U_Batt >= 160) 12 = ECMStat.p_Diff >= -200 and ramp 0/1 13 = Purge.HCCont > (obdEvap.HCContPrecondition + pEvapTestCal->HCContDiff) 14 = obdEvap.m_Delta > EvapDiagCal.m_Delta 16 = !FuelLevel.isFuelLevelConfirmed() 17 = FCut.ST_FuelCut = true 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->pAirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This willstop active test for rest of the DCY 20 = obdEvap.p_FuelTankFilt < pEvapTestCal->MinTankPressure 101 = Pressure out of lim 102 = Fuellevelripple 103 = obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim 105 = Fuellevelripple during ramp2 evaluation small pos direction 106 = Fuellevelripple during ramp2 evaluation small neg direction 108 = If Lambda.LambdaInt diff of obdEvap.LambdaPrecondition 150 -> 200 = Big leak errors detected, needed 2 for error report when ignition off 254 = OBDAdapEvap.Evap2BigResDiff > 0 255 = obdEvap.n_TooMuchVapour >= pEvapTestCal->n_TooMuchVapourLim";
