                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.PosRampStep":
                        description = helptext = "After engine start and when the LightOff ignition become active, the LightOff ignition offset shall increase slowly to make the disturbance as small as possible. This calibration variable sets the step this offset shall make every 7.5ms. Resolution is 0.001 °/7.5 ms  .";
