                        break;
                    case "IgnLOffCal.NegRampStep":
                        description = helptext = "When the LightOff ignition become deactive due to that the: - temp limit has exceeded or - number of combustions with LightOff has exceeded the LightOff ignition offset is decreased slowly to make the disturbance as small as possible. This calibration variable sets the step this offset shall make every 7.5ms. Resolution is 0.001 °/7.5 ms  .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.PosDeltaLim":
                        description = helptext = "Maximal increment of Light Off ignition offset when the start phase is over. Resolution is 0.1 °/7.5 ms  .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.No10msDelay":
                        description = helptext = "Number of 20ms periods delay before m_request is copied to m_requestLO. Resolution is 20ms.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.ST_AllowRestart":
                        description = helptext = "0: Lightoff ignition will be restarted only after an ECU powerdown (15-20 min Ignkey off). Following starts without preceeding powerdown will LO be disactiveted. 1: Lightoff ignition will be restarted at every engine restart if the normal lightoff conditions are OK. 2: Lightoff ignition will be restarted only after an ECU powerdown (15-20 min Ignkey off). If engine is restarted before IgnLOffProt.NrCombustion is counted down to zero will it countinue with LO but no new value on IgnLOffProt.NrCombustion will be read.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.T_AirInletSP":
                        description = helptext = "Support points for N_AirTab. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnLOffCal.N_AirTab":
                        description = helptext = "Number off combustions after start as a function of In.T_AirInlet with activated light off ignition offset. The lowest of CombTab and N_AirTab will be used -> stored in IgnLOffProt.NrCombustion. This double check will avoid a \"False\" trigg of LO. Example: After a cold start at -20 no LO is used. If engine stalls and is restarted again watertemp may have increased to a temperature where LO is active. To avoid this LO activation a double check is done with the T_AirInlet and the lowest number of comb is used. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.fi_Basic":
                        description = helptext = "Basic ignition offset witch are activated as son as engine speed delta are above limit and N_CombPart1 number of combustions have passed since last time. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.n_DiffXSP":
                        description = helptext = "Support points for offset, engine delta. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.fi_Tab":
                        description = helptext = "Anti jerk ignition offset Table. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.n_LimTabSP":
                        description = helptext = "Support points for engine speed delta limit to activate function. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.n_LimTab":
                        description = helptext = "Engine speed delta limit to activate function. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.N_CombPart1":
                        description = helptext = "Min number of combustions function should been active. If negative delta are detected during this time are number of combustions function are active increased with N_CombPart2. Resolution is 1 comb.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.N_CombPart2":
                        description = helptext = "Se description N_CombPart1. Resolution is 1 comb.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.fi_RampStep":
                        description = helptext = "Step of ignition offset during ramp back to 0. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.n_EnDelta":
                        description = helptext = "Min rpm delta for possibility to enable function. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.X_PedalLim":
                        description = helptext = "Above this limit are function only active IgnJerkCal.n_Comb. Resolution is 0.1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.n_Comb":
                        description = helptext = "Number of combustions function should been active above pedal limit. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "IgnJerkCal.T_EngLim":
                        description = helptext = "Temp limit for possibility to activate jerk offset. Resolution is 1 °C.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkSoundRedCal.fi_OffsMap":
                        description = helptext = "Knocksound reduction ignition offset map. Used to reduce knock sound with adjustment from Tech2. By adjusting the \"FlashSave.KnkSoundRedFac\" is the ignition offset from this map used. This offset is treated like a temperature offset and will affect the fuel and maximum air limitation. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkSoundRedCal.T_LowLim":
                        description = helptext = "Below this inletair temp limit is the ignition offset for constant torque reduction always 0.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkSoundRedCal.T_HighLim":
                        description = helptext = "Abowe this inletair temp limit is the constant torque reduction offset taken directly from the map. Below this limit and abowe the KnkSoundRedCal.T_LowLim is the map ignition offset interpolated before it is copied to \"KnkSoundRedProt.fi_Offset\".";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkSoundRedCal.ST_Enable":
                        description = helptext = "Activation of knock sound function.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDet.ST_Knock":
                        description = helptext = "Indicate if engine is knocking on any cylinder. \"ON\" - Engine is knocking on one or more cylinders. \"--\" - Engine is not knocking on any cylinder. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDet.ST_ClearIgnOff":
                        description = helptext = "Indicate if ignition offsets should been cleared with pedal released due to knock reference adaption. \"ON\" - Clear ignition offset. \"--\" - No action. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDet.KnockCyl":
                        description = helptext = "Indicate wich cylinder engine is knocking on. If the byte is zero no knocking is detected. Byte 1 - Cyl 1 Byte 2 - Cyl 2 Byte 3 .. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDet.RefValueActual":
                        description = helptext = "RefValueActal are actual reference level for knock detection based on KnkAdaptAdap.RefValueWind[0] and KnkAdaptAdap.RefValueWind[1]. The values are interpolated between the two variables. X-value for window 1 is KnkAdaptCal.RPMRefSP[0] and for window 2 is KnkAdaptCal.RPMRefSP[1]. RefValueActal is used by KnkDetProt.U_RefLevelActual ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt.IgnOffset":
                        description = helptext = "Ignition offset used while knock adaption samples are sampled. Resolution is 0.1 °.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.X_Average":
                        description = helptext = "Number of readings for calculating average U_Knock signal. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.Constant":
                        description = helptext = "Constant for calculation off knock reference level, this value is from KnkAdaptCal.ConstantTab. The value is used by KnkDetProt.U_RefLevelActual.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.U_LevelActual":
                        description = helptext = "Actual value on the knock voltage used to detect knocking condition. The average value is calculated with the two last values on \"In.U_Knock\" for a specific cylinder. If the average value is higher than actual \"In.U_Knock\", will the \"In.U_Knock\" be copied to \"U_LevelActual\". If the average value is lower than \"In.U_Knock\" will the average value be copied to \"U_LevelActual\". Resolution is 1 mV. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.U_KnockCyl":
                        description = helptext = "Actual value on \"U_LevelActual\" for a specific cylinder. (Not used by software, only for application). Resolution is 1 mV. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.U_RefLevelActual":
                        description = helptext = "Actual reference voltage to detect knocking. KnkDetProt.U_RefLevelActual = \"Knock reference adaption level\" * KnkDetProt.Constant KnkDetProt.RefFactor The \"Knock reference adaption level\" = QAdapt.RefValue in conditions: KnkAdapCal.ST_QAdapt == 1 and KnkDetProt.NrOfRefAdapt1 == 0 and KnkDetProt.NrOfRefAdapt2 == 0 and QAdapt.RefValue > KnkDet.RefValueActual else is \"Knock reference adaption level\" = KnkDet.RefValueActual. Resolution is 1 mV. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.KnockWinOffs":
                        description = helptext = "Actual angle between ignition angle and start of knock window. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.KnockWinAngle":
                        description = helptext = "Actual angle between start and stop of knock window. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.RefFactor":
                        description = helptext = "Actual factor used to calculate the reference voltage for knockdetection KnkDetProt.U_RefLevelActual. This factor is from map KnkDetCal.RefFactorMap. If F_KnkDet.ST_Active is set (false knock detected) then is the map value decreased with: KnkDetProt.RefFactor = KnkDetProt.RefFactor / KnkDetCal.X_FalseDetRef ( More info about false knock detection in structs: F_KnkDet, F_KnkDetCal )  Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.U_RefLev2":
                        description = helptext = "Actual reference level to detect major knocking. KnkDetProt.U_RefLev2 = KnkDetProt.U_RefLevelActual * KnkDetCal.MulFacRef2 100 If In.U_knock are above this value are knocking detected. Resolution is 1 mV. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.NrOfRefAdapt1":
                        description = helptext = "Number of adaptions performed. Added by Mea-TLn 2001-02-23";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.NrOfRefAdapt2":
                        description = helptext = "Number of adaptions performed. Added by Mea-TLn 2001-02-23";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.ST_EngTEnableKnk":
                        description = helptext = "0- Engine temp below watertemp limit for knock control. 1- Engine temp above watertemp limit for knock control. Added by Mea-TLn 2001-02-23";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.Time":
                        description = helptext = "Time variable used for knockadaption Added by Mea-TLn 2001-02-28";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.Time2":
                        description = helptext = "Time variable used for knockadaption Added by Mea-TLn 2001-02-28";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetProt.T_EngKnkCntrlLim":
                        description = helptext = "Airinlet temp dependent engagement limit for knock control. Added by Mea-TLn 2001-03-01";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.BufferFilled":
                        description = helptext = "Indicate if buffer are filled and calculation off median value for reference level could start.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.Finished":
                        description = helptext = "Indicate if calculation off median value are finished.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.MaxLevel":
                        description = helptext = "Max reference value for knock detection depending on engine speed. Resolution is 1 mV. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.FirstTimeCounter":
                        description = helptext = "Counter for use to avoid first ten simples inside actual window.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.Counter":
                        description = helptext = "Counter used when U_Knock are saved in a buffer.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.Buffer":
                        description = helptext = "Buffer where U_Knock are saved. Resolution is 1 mV.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.RpmHyst":
                        description = helptext = "Actual engine speed hysteres depending if we are in window or not. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.LoadHyst":
                        description = helptext = "Actual load hysteres depending if we are in window or not. Resolution is 1 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.RefValue":
                        description = helptext = "Median value off U_Knock.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.Temp":
                        description = helptext = "Buffer used during calculation off median value.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot.AdapFac":
                        description = helptext = "Weight factor to adjust In.U_knock before it's saved in buffer. Resolution is 0.001.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot2.BufferFilled":
                        description = helptext = "Indicate if buffer are filled and calculation off median value for reference level could start.";
                        category = XDFCategories.Undocumented;
