                    case "KnkAdapt1Prot2.Finished":
                        description = helptext = "Indicate if calculation off median value are finished.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot2.MaxLevel":
                        description = helptext = "Max reference value for knock detection depending on engine speed. Resolution is 1 mV. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot2.FirstTimeCounter":
                        description = helptext = "Counter for use to avoid first ten simples inside actual window.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
