                    case "KnkAdapt1Prot2.RefValue":
                        description = helptext = "Median value off U_Knock.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot2.Temp":
                        description = helptext = "Buffer used during calculation off median value.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt1Prot2.AdapFac":
                        description = helptext = "Weight factor to adjust In.U_knock before it's saved in buffer. Resolution is 0.001.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt2Prot.ActualWindow":
                        description = helptext = "What adaption window is active now. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt2Prot.IgnReduceCounter":
                        description = helptext = "Counter to count when ignoffset is set while knock adaption sampels are taken. This counter goes from 0 to 3. 0 - Waiting to set IgnOffset[Cyl] for last cyl (Cyl-1). 1 - Indicate that IgnOffset[Cyl] is set for last cyl and no other. 2 - One reduced ignition confirmed. 3 - Two reduced ignition confirmed. Take U_Knock sample and go for next cyl. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdapt2Prot.lastCyl":
                        description = helptext = "Cyl nr, comb before this comb. Resolution is 1.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetAdap.KnkCntMap":
                        description = helptext = "This map includes number of knock detections on specified load points. Interval is At every knock detection.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetAdap.KnkCntCyl":
                        description = helptext = "Number of knock detections on every specific cylinder. Interval is At every knock detection.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdaptAdap.RefValueWind":
                        description = helptext = "RefValueWind are a filtered median value of U_Knock for low and high knock adaption window. Knock adaption that is not finished is always reseted when the engine is restarted. The knock adaption is not active for a number of seconds (KnkAdaptCal.AdaptStartDelay) after start. If KnkAdapCal.ST_SmartGuess is set is the smart guess function active. Filtering is done to reduce variations in knock adaption. For more help read help KnockAdaption.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdaptAdap.RefValueLowWind":
                        description = helptext = "RefValueLowWind are a copy of KnkAdaptAdap.RefValueWind[0]. This it's done because the local_id.exe can't get the information of adress from symboltable.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdaptAdap.RefValueHighWind":
                        description = helptext = "RefValueHighWind are a copy of KnkAdaptAdap.RefValueWind[1]. This it's done because the local_id.exe can't get the information of adress from symboltable.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkAdaptAdap.RefValueWRaw":
                        description = helptext = "Referense value before filtering and range check. Added by MEA-TLn 2001-02-27.'";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.T_InletAirXSP":
                        description = helptext = "Air temp supportpoints for calculation of airtemp dependent watertemp limit for engagement of knock control replaces earlier fixed limit of 60 degrees. Added by MEA-TLn 2001-02-28.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.T_EngKnkCntrl":
                        description = helptext = "Water temp table for calculation of airtemp dependent watertemp limit for engagement of knock control replaces earlier fixed limit of 60 degrees. Added by MEA-TLn 2001-02-28.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.m_AirXSP":
