                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.KnockWinOffs":
                        description = helptext = "Angle between ignition angle and start of knock window depending on engine speed and load (OBS ! support points chared with KnkDetProt.RefFactorMap)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.KnockWinAngle":
                        description = helptext = "Angle between start and stop of knock window depending on engine speed.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.KnockWinAngleNS":
                        description = helptext = "Angle between start and stop of knock window depending on engine speed, engine not synced.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.X_AverageTab":
                        description = helptext = "Number of readings for calculating average U_Knock signal. Resolution is 1 .";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.MulFacRef2":
                        description = helptext = "This factor are multiplicated with ordinary reference level. Knocking are detected if In.U_Knock are above this level. Resolution is 1 %.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.n_LimWinOff":
                        description = helptext = "Engine speed limit for possibility to decrease knock window. Resolution is 1 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.U_BattSP":
                        description = helptext = "Support points for KnkWinOffTab. Resolution is 0.1 V.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.KnkWinOffTab":
                        description = helptext = "Table for how much knock window should been decreased with low battery.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.RefShiftFactor":
                        description = helptext = "Reference factor for that replaces KnkDetProt.RefFactor at shifts if ( Ign.ST_TrqIgnActive ) { if ( KnkDetProt.RefFactor > KnkDetCal.RefShiftFactor ) { KnkDetProt.RefFactor = KnkDetCal.RefShiftFactor; } }";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "KnkDetCal.X_FalseDetRef":
                        description = helptext = "Increase factor of knockreference value when FalseDetMode > 0.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
