                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_CruiseIncluded":
                        description = helptext = "Indicates if cruise is present in the system. If the cruise lamp ones have been active will this flag be set and newer cleared.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_EngineStarted":
                        description = helptext = "Indicate if engine have started. 1 => started 0 => not started.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_Automatic":
                        description = helptext = "Indicate if automatic gearbox is detected. 1 => Automatic 0 => Manual gearbox.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_DICE_Node":
                        description = helptext = "Indicate if DICE node is detected on CAN-buss. 1 => DICE Detected 0 => DICE Not detected";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_MIU_Node":
                        description = helptext = "Indicate if MIU node is detected on CAN-buss. 1 => MIU Detected 0 => MIU Not detected";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_SID_Node":
                        description = helptext = "Indicate if SID node is detected on CAN-buss. 1 => SID Detected 0 => SID Not detected";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_AutNeutral":
                        description = helptext = "Indicate if automatic gearbox is in neutral position. 1 => Neutral position 0 => Not neutral position.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_EngineSynced":
                        description = helptext = "Indicate if engine have syncronised 1 => engine syncronised 0 => engine not syncronised";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_PedalReleased":
                        description = helptext = "Indicate if accelerator pedal is released. This flag is set in the idle air routine. 1 => Pedal released 0 => Pedal not released";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_EngineMoving":
                        description = helptext = "Indicate if engine is moving. 1 => engine is moving. 0 => engine is still.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_EngNotMoving":
                        description = helptext = "Indicate if engine not is moving. 1 => engine is not moving. 0 => engine is moving.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_ThrottleLimpHome":
                        description = helptext = "Indicate if throttle is in limphome 1 => Throttle is in limphome. 0 => Throttle is not in limphome.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_TCSCANBased":
                        description = helptext = "Indicate if Traction control system (TCS) is detected on bus instead from PWM. This implies that v_Vehicle is taken from the bus instead of from analog input.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_BlkHeatStart":
                        description = helptext = "The start was identified as a blockheater start and should therefor have extra enrichments since the value of the engine temperature is unreliable";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_ESPEquiped":
                        description = helptext = "Indicatates if vehicle is equiped with ESP (Electronic Stability Program)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_hotFuelStart":
                        description = helptext = "According to CARB's definition of a hot fuel start is fullfilled this vaiable is set and cleared at ignitionOff. Definition : if MissfAdap.T_EngOff >= MissfCal.T_EngOffLim(110) and obdStartTemp >= MissfCal.T_hotStartLim(110) and In.T_AirInlet >= MissfCal.T_hotAirLim(70) and within first 1000 combustions";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ManualGear":
                        description = helptext = "Actual gear (manuel gearbox). Fwd 1-5 Rew 'R' Undefined 'U' ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.ST_ActiveAirDem":
                        description = helptext = "Active function demanding airmass DRIVE MASTER = 1x LIMIT WHEEL = 3x 10 = PedalMap 30 = Not used 11 = Cruise Control 31 = Max Vehicle Speed 12 = Idle Control MIN LIMIT ENGINE = 4x TORQUE MASTER = 2x 40 = LDA Request 20 = Max Engine Torque 41 = Min Load 21 = Traction Control 22 = Manual Gearbox Limit MAX LIMIT ENGINE = 5x 23 = Automatic Gearbox Lim 50 = Knock Airmass Limit 24 = Stall Limit (Automatic) 51 = Max Engine Speed 25 = Special Mode 52 = Max Air for Lambda 1 26 = Reverse Limit (Automatic) 53 = Max Turbo Speed 27 = Misfire Diagnose Limit 54 = Crankcase vent error 28 = Brake Management 55 = Faulty APC 29 = Diff Prot (Automatic) EMISSION LIMITATION = 6x 61 = Engine Tipin Limitation 62 = Engine Tipout Limitation SAFETY LIMITATION = 7x 70 Safety Switch";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.n_CombWhenSync":
                        description = helptext = "The combustion count when engine synched.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.msCounter":
                        description = helptext = "Milliseconds counter from reset of ECU. Resolution is 1 msec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.n_Combustion":
                        description = helptext = "Number of combustions since engine was started. This flag is cleared when the engine have been still for 200ms. Resolution is 1 combustion. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.n_CombustionSync":
                        description = helptext = "Number of combustions since engine was started. This flag is cleared when the engine is restarting to syncronice ignition and is used for sync diagnose. Resolution is 1 combustion. Interval is Every combustion.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.p_Diff":
                        description = helptext = "Differance between inlet manifold air pressure and external air pressure. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.n_Engine10ms":
                        description = helptext = "Copy of In.n_Engine made early in the 10 ms function caller, to make it possible to use the same engine speed pointer in different functions. Resolution is 0 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.p_DiffThrot":
                        description = helptext = "Differance between inlet manifold air pressure and air pressure before throttle. Resolution is 0.1 kPa.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.t_Soak":
                        description = helptext = "Time engine have been stopped. Resolution is 1 sec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.FuelBe":
                        description = helptext = "Fuel consumtion in g/kWh (Be).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.FuelFlow":
                        description = helptext = "Fuel flow in g/h.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.AirFuelRatio":
                        description = helptext = "Ratio between air (MAF.m_AirInletFuel or MAF.m_AirInmletTorq) and actual injected fuel.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.t_StartTime":
                        description = helptext = "Engine start time, measured by measuring the time from that the battery volatage decreases 1.0V to the time engine speed reached 1000 rpm.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.P_Engine":
                        description = helptext = "Calculated engine power. Measured in horsepower.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.T_Catalyst":
                        description = helptext = "Calculated catalyst temperature.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.n_EngineDelta2":
                        description = helptext = "Difference of delta In.n_Engine, measured every combustion";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "ECMStat.JerkFactor":
                        description = helptext = "This factor describes the jerking of the engine. The formula for calculating this is abs(ECMStat.n_EngineDelta2) * factor. The factor is for scaling it so it will be possible to filter it. The calibratable value used for filtering is nEngCal.FilterFactor. Since the jerk factor is based on every combustion, it is not possible to compare the numbers for 6 cylinder engines and 4 cylinder.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkProt.JerkFactor":
                        description = helptext = "Threshold value for changing shift pattern to \"no lockup\"";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkProt.T_AirInlet":
                        description = helptext = "Temperature where jerk program was activated";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkProt.X_AccPedal":
                        description = helptext = "Pedal position at detection of jerk";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.T_AirInletTab":
                        description = helptext = "Threshold value table for changing shift pattern depending on inlet temperature";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.T_AirInletSP":
                        description = helptext = "Support pointer for T_AirInletTab";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.p_AirAmbientTab":
                        description = helptext = "Compensation factor for determing jerking of engine depending on ambient pressure";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.p_AirAmbientSP":
                        description = helptext = "Support pointer for p_AirAmbientTab";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.n_EngineTab":
                        description = helptext = "Compensation factor for determing jerking of engine depending on engine speed";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.n_EngineSP":
                        description = helptext = "Support pointer for n_EngineTab";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.t_JerkAbove":
                        description = helptext = "Duration of ECMStat.JerkFactor above JerkCal.JerkFactor to use \"no lockup\" shiftpattern";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.t_JerkBelow":
                        description = helptext = "Duration of ECMStat.JerkFactor below JerkCal.JerkFactor to use \"Lockup\" shiftpattern";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.CruiseFactor":
                        description = helptext = "Factor multiplied with the threshold value when cruise is activated";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.JerkFilter":
                        description = helptext = "Filter factor to calculate jerkfactor.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_JerkTempRed":
                        description = helptext = "Temperature must have dropped by this percentage to allow eco-mode jerkprogram";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_OffSteadyThr":
                        description = helptext = "Offset multiplied to jerkfactor at which the transmission should shift to jerkprogram at constant pedal position-";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_AccPedalLim":
                        description = helptext = "Low Limit for pedal position to enable possibility to change gearmode (jerk, eco)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_AccPedalDiff":
                        description = helptext = "Minimum pedal position differance to change mode to jerkmode. change gearmode (jerk, eco)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_AccPedal4Diff":
                        description = helptext = "Low Limit for pedal position to enable possibility to change gearmode at 4 lockup (jerk, eco)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_AccPedal3Diff":
                        description = helptext = "Low Limit for pedal position to enable possibility to change gearmode at 3 lockup (jerk, eco)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_3GearFac":
                        description = helptext = "Factor multiplied with the threshold value when 3 lockup is activated";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.X_4GearFac":
                        description = helptext = "Factor multiplied with the threshold value when 4 lockup is activated";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "JerkCal.T_AirInletMin":
                        description = helptext = "Below this temperature, use 100 as reactivation temperature for jerk->eco program to disable the temperature limit function";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SID.ST_Mode":
                        description = helptext = "Mode to switch between SID function 0 = Adaption 1 = Exhaust 2 = TCM FUEL/DTI 3 = TCM GSI/CSLU 4 = TCM TRQ/SPEED 5 = ESP 6 = Purge";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "PLT.PlottPosition":
                        description = helptext = "Position were sample buffer should been updated. 0 = 66 deg. BTDC. 1 = Before ignition master. 2 = After ignition master. 3 = Before fuel master. 4 = After fuel master. 5 = Before knock master. 6 = After knock master. 7 = Before missfire master. 8 = After missfire master. 9 = Before sync master. 10 = After sync master.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPProt.ST_Active":
                        description = helptext = "Change shift pattern to \"Reduced Engine Performance\" pattern Bit 0 = Normal detection of low perfomance enables REP Bit 1 = Gear shift support function enables REP 0 = Not active 1 = Normal function request REP 2 = Gear shift support request REP 3 = Normal + Gear shift support request REP";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPProt.p_AirAmbient":
                        description = helptext = "Enable REP shift pattern on altitude below this pressure";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPProt.ST_GSIState":
                        description = helptext = "State of Gear shift inhibit function 0 = Default, no action 1 = Down shift detected, wait until X_AccPedal decreases to change to state 2 or change to state 0 if P_Engine is less that before shift. 2 = Gear inhibit. Inhibit gear shift until P_Engine is lower than before shift and a certai time has elapsed. Activate REP shift pattern to lower the limit where a shift is done 3 = Out.X_AccPedal has been furher pressed than before the shift. This implies that there is not enough power though the gear has been shifted down. Allow further down shifts. 4 = Wait until 5-lockup is inserted to change shift pattern to normal (ECO)";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPProt.P_Saved":
                        description = helptext = "Gear shift inhibit variable. ECMStat.P_Engine before the shift. This is decreased with the hysteresis value at transition to state 2. The actual engine power must be below this value to change state and remove the inhibit signal.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPProt.X_LastPedal":
                        description = helptext = "Gear shift inhibit variable. Out.X_AccPedal before the shift. If Out.X_AccPedal is increased after the shift above this saved value, goto state 3 and allow gear shift again";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.T_AirInletSP":
                        description = helptext = "T_AirInlet support pointer for T_AirInletTab";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.T_AirInletTab":
                        description = helptext = "Table for activating REP shift pattern below a certain ambient pressure.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.p_AirAmbientHyst":
                        description = helptext = "Offset added to table value to disactivate REP shift pattern";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.P_EngineMinLimit":
                        description = helptext = "Minimum value of ECMStat.P_Engine to disactivate gear shift inhibit function.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.P_EngineHyst":
                        description = helptext = "Actual value of ECMStat.P_Engine is saved at shift and this calibratable value creates a lower value that must be passed before disactiving gear shift inhibit function";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.t_InhibitMin":
                        description = helptext = "Minimum time that the gear shift inhibit function actually inhibits the gear shift";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "REPCal.ST_GearShiftInhibit":
                        description = helptext = "Enables gear shift inhibit function 0 = Do not use function 1 = Only use CMD_GearShiftInhibit 2 = Use both CMD_GearShiftInhibit and CMD_REP 3 = As 2 even without cruise The conditions to enable gear shift inhibit are: 1500 < In.n_Engine < 4000 rpm Out.X_AccPedal < 80% In.v_Vehicle > 50km/h";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SystemCal.ShutOffTime":
                        description = helptext = "Time after ignition key is turned off until ECU is turned off. Resolution is 1 sec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "SystemCal.EngineType":
                        description = helptext = "This is the Engine Type information send on VBUS/CAN to other systems. OBS, OBS This data shall NOT be written to by any calibration engineer. This data is automaticly set by AppTool when ECU ID information is  entered to the hex file. This data will only be active when T7 is completely handeld by AppTool. As long as T7 is handeld with the old environment, like  make_r4/make_v6 shall this data be 0xFF (255) ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.ST_DubbelInjection":
                        description = helptext = "Set this flag to continously enable dubbel injection. The engine must first syncronice after start to enable this function in a correct way. Wery long injection times can be a problem in this mode. The ignition pulses will not be dubbel. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.m_FuelActual":
                        description = helptext = "If this data not is zero will it be used as actual fuelmass to obtain a fixed injectiontime. Resolution is 0.01 mg/c.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.X_AccPedReq":
                        description = helptext = "If this data not is zero will it be used as In.X_AccPedal. (the \"App7Cal.ST_PedalLoop\" must also be set to trigg this function). ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.X_AccPedReqHigh":
                        description = helptext = "This is the high Pedal position during a AirmassStep run. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.X_AccPedReqLow":
                        description = helptext = "This is the low Pedal position during a AirmassStep run. ";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.t_Ramp":
                        description = helptext = "This is the ramptime both going from low to high and from high to low pedal position during a AirmassStep run. Resolution is 0.01 sec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.t_HighLevel":
                        description = helptext = "This is the time running on the high pedal position during a AirmassStep run. Resolution is 1 sec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.t_LowLevel":
                        description = helptext = "This is the time running on the low airmass level during a AirmassStep run. Resolution is 1 sec.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.ST_PedalLoop":
                        description = helptext = "Status bit to activate the APP7 pedal simulation. 0 - Not active ( pedal pos is calc from In.AD_AccPedal ). 1 - loop is activated.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.X_StepCycles":
                        description = helptext = "This data is the number of step cycles which will be runned before stoping pedal simulation. 0 -> Running forever (running until ST_PedalLoop = 0).";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.AirMode":
                        description = helptext = "Select the air control mod. 0 - Normal 1 - App7Cal.m_Request overrides m_Request 2 - Force Boost control to closed loop andOverride the throttle with App7Cal.A_Throttle 3 - Force Boost control to open loop andoverride the Valve withPWM_BoostCntrl 4 - Force the throttle to closed loop";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.PWM_BoostCntrl":
                        description = helptext = "If AirMod >= 3this data will be used as output. elseApp7CAl.PWM_BoostCntrl = Out.PWM_BoostCntrl";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.FuelMode":
                        description = helptext = "Select the fuel control mod. 0 - Normal 1 - App7Cal.m_FuelActual overrides the fuel";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.IgnMode":
                        description = helptext = "Select the fuel control mod. 0 - Normal 1 - App7Cal.fi_Ignition overrides the ignition angle";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "App7Cal.FuelFactor":
                        description = helptext = "Factor to make fuel corrections in testbeds";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_GradHigh":
                        description = helptext = "Gradient for throttle angle limitation upper range. Resolution is bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_GradLow":
                        description = helptext = "Gradient for throttle angle limitation lower range. Resolution is bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_StartHigh":
                        description = helptext = "startangle for angle limitation upper range. Resolution is bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
                        break;
                    case "AngleLimCal.AD_StartLow":
                        description = helptext = "startangle for angle limitation lower range. Resolution is bit.";
                        category = XDFCategories.Undocumented;
                        subcategory = XDFSubCategory.Undocumented;
